(34, 'Jose Cuervo Especial', '750 ml', '<p>Cabe mencionar que la gran mayorÃ­a de los productos JosÃ© Cuervo, siguen siendo producidos dentro de la fÃ¡brica la RojeÃ±a. Actualmente esta fÃ¡brica es un gran atractivo turÃ­stico en la ciudad, ya que sus instalaciones siguen manteniendo varios de los equipos utilizados hace 200 aÃ±os, ademÃ¡s de contar con un pequeÃ±o museo acerca de la historia y producciÃ³n del tequila en MÃ©xico.</p>', 'Con un sabor suave, el Tequila Jose Cuervo Especial es reposado en  barriles de roble que se almacenan en los sÃ³tanos de la finca-fÃ¡brica La RojeÃ±a por mÃ¡s de 6 meses lo que le permite tener el sabor perfecto para tomarlo puro o en un delicioso coctel Margarita.', 7, 69950, 1, 1, 'jose-cuervo-especial', 7, 0, 'Jose Cuervo Especial | LaLicorera.com', 'Tequila Jose Cuervo Especial, a domicilio, online, en bogota, Colombia', 'tequilas jose cuervo especial cuerbo'),
(53, 'Cerveza Corona Extra', '355 ml', '<p>En la dÃ©cada de los 80, los turistas americanos que viajaban a MÃ©xico solÃ­an acompaÃ±ar la Cerveza Corona con una tajada de limÃ³n dentro del cuello de la botella, desde entonces es tendencia mundial beberla de esa forma.</p>\r\n<p>Cerveza Corona Extra, una de las cervezas mÃ¡s famosas de MÃ©xico, del tipo â€œlagerâ€, con 4,6 grados de alcohol y un contenido bajo en lÃºpulo.</p>\r\n<p>Â </p>', 'Cerveza Corona Extra, una de las cervezas mÃ¡s famosas de MÃ©xico, del tipo â€œlagerâ€, con 4,6 grados de alcohol y un contenido bajo en lÃºpulo.', 3, 4400, 1, 37, 'corona-extra', 10, 0, 'Corona Extra | LaLicorera', 'Cerveza Corona Extra a domicilio en bogota online', 'cervezas polas chelas birras virras frÃ­as botellas corona extra 330 mililitros ml'),
(26, 'Buchanans 12 aÃ±os', '750 ml + Kit de Regalo Delantal', '<p>Whisky Buchanans 12 aÃ±os. Creado en 1897 por el SeÃ±or James Buchanan en sociedad con el SeÃ±or Lowrie conocido empresario de Whisky Blended.</p>\r\n<p>Un excelente producto que combina aroma y sabor a su justa medida.</p>', 'En la actualidad la presentaciÃ³n estÃ¡ndar del Whisky Buchananâ€™s 12 aÃ±os ofrece un whisky de alta calidad, fresco y dulce, con un definido y sensual aroma ahumado, caracterÃ­stico de las barricas de roble en las cuales se almacena para ser aÃ±ejado.', 10, 109900, 1, 31, 'buchanans-12-anos', 2, 0, 'Buchanans | LaLicorera.com', 'Whisky Buchanans 12 aÃ±os', 'Scotch whiskey whisky wiskey wisky whyskey whysky wisqui uisqui uiski whiskhey wiskhey wiskhi wiskhy wyskey buchananss buchannanss bukananss buchanass buchannass bucanass bucananss 12 doce aÃ±os anos '),
(2, 'Grey Goose Vodka', '750ml', '<p>Grey Goose Vodka, uno de los vodka premium de la actualidad, es destilado a partir de un proceso cuidadoso con piedra caliza desmineralizada y filtrado con agua mineral en el corazÃ³n de Francia â€“ RegiÃ³n de Cognac.</p>\r\n<p><a title=\"Vodka Grey Goose\" href=\"http://www.greygoose.com/LDA?returnURL=/our-process\" target=\"_blank\">FranÃ§ois Thibault</a> creador del Grey Goose Vodka, reconocido como el maestro de la destilerÃ­a, se preocupÃ³ por tener los mÃ¡s altos estÃ¡ndares en la producciÃ³n del Grey Goose Vodka, en la actualidad este vodka goza de gran prestigio entre las elites altas de Europa y Asia.</p>', 'Grey Goose Vodka, lanzado en 1997. Es destilado del maÃ­z que crece en Picardie (Norte de Francia) usando 5 procesos en columna para lograr su mÃ¡xima pureza. No contiene azÃºcar, sabor ni ningÃºn aditivo.', 9, 186900, 1, 3, 'grey-goose', 2, 0, 'grey goose vodka | LaLicorera.com', 'licor online, vodka online, bogota, colombia', 'vodka bodka vodca bodca grey gray goose guse gose grei'),
