o-para-margin-bottom:.0001pt;\r\n	mso-pagination:widow-orphan;\r\n	font-size:12.0pt;\r\n	font-family:Cambria;\r\n	mso-ascii-font-family:Cambria;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Cambria;\r\n	mso-hansi-theme-font:minor-latin;}\r\n</style>\r\n<![endif]--> <!--StartFragment--> <!--EndFragment--></p>\r\n<p>Fue lanzado en el mercado de USA hacia el aÃ±o 1978. Se dice que la forma de su botella es en honor a los monjes de la cordillera de Piamonte - Italia, quienes en el siglo XVII solÃ­an destilar licores con infusiones de cacao, cafÃ©, vainilla, entre otros.</p>', 'Frangelico, un licor especial y muy famoso entre las personas que gustan del chocolate, nueces, vainilla, entre otros.\r\n\r\nEl Frangelico es especial para dÃ­as en que se quiere acompaÃ±ar el relax con un excelente licor.\r\n', 4, 119000, 1, 5, 'frangelico', 8, 0, 'Frangelico | LaLicorera.com', 'licor frangelico en bogota, licor a domicilio en BogotÃ¡, licor con sabor a avellanas, ', 'frangelico franjelico nueces licor de avellanas'),
(6, 'Milagro barril selecto reserva  reposado', '750ml', '<p>El Tequila artesanal Milagro barril selecto reserva reposado, es destilado 3 veces de agave 100% azul, almacenado y aÃ±ejado en barriles franceses durante 10 meses.</p>\r\n<p>Verdaderamente sobra una descripciÃ³n de todas la propiedades acerca de este tequila artesanal, ya que basta solo con apreciar y tener en las manos la botella en la cual es almacenado para poderse imaginar todas sus excelentes propiedades.</p>', 'Esta ediciÃ³n especial del tequila artesanal Milagro barril selecto reserva reposado, hace honor a uno de los mejores tequilas que se puede encontrar alrededor del mundo.\r\n\r\nEste tequila de ediciÃ³n especial es tratado verdaderamente especial y las palabras sobran de solo ver la botella en el cual es almacenado.', 7, 199900, 1, 0, 'milagro-reserva-reposado', 8, 0, 'Tequila reposado milagro reserva | LaLicorera.com', 'Tequila artesanal milagro reserva reposado, mejores y famosos tequilas alrededor del mundo, licor a domicilio en bogotÃ¡', 'tequilas milagro barril especial selecto reserva artesanal reposado'),
(7, 'Belvedere', '750 ml', '<p class=\"MsoNormal\" style=\"text-align: justify;\">Edward Jay Phillips creador de la botella de Belvedere sabÃ­a que en sus manos tenÃ­a un vodka super premium, por tal motivo necesitaba mostrarlo al mundo de una manera impactante. Como resultado, se tiene una botella larga, con el efecto de estar congelada y con el palacio de donde deriva su nombre impreso en la parte de atrÃ¡s, y acompaÃ±ada de dos arboles cubiertos de nieve.</p>', 'Vodka Belvedere es reconocido a nivel mundial por ser el primer vodka  en recibir el tÃ­tulo de Vodka SÃºper Premium. Vodka 100 proof  50% alc.', 9, 199900, 1, 2, 'belvedere', 3, 0, 'Belvedere Vodka | LaLicorera.com', 'domicilio vodka, belvedere, bogota, colombia', 'veldevere beldebere veldebere beldevere vodka bodka vodca bodca'),
(8, 'NUVO', '750 ml', '<p class=\"MsoNormal\" style=\"text-align: justify;\">El Nuvo con su color rosa caracterÃ­stico, en su primera etapa de comercializaciÃ³n, era un licor dirigido hacia las mujeres, de allÃ­ la frase incluida en la botella Â¨For HerÂ¨ (Para ella), sin embargo, con el tiempo para captar un mayor pÃºblico, esta frase se eliminÃ³ de la etiqueta.Â </p>', 'Nuvo, con su diseÃ±o de perfume francÃ©s, es una perfecta combinaciÃ³n entre nÃ©ctar de vino blanco francÃ©s, vodka francÃ©s, vino espumoso francÃ©s, frutas exÃ³ticas y un toque de agua carbonatada.', 9, 62000, 0, 0, 'vodka-nuvo', 4, 0, 'Vodka Nuvo Bogota Colombia', 'vodka nuvo online bogota Colombia', 'nuvo vodka bodka vodca bodca perfume nubo');
