(187, 'Amarula - Licor de Frutas', '750 ml', '<p>Amarula, licor destilado y fermentado durante 2 aÃ±os en barriles franceses; despues es mezclado con crema. Disfrutalo en hielo y dale a tu paladar el placer de degustar la fruta salvaje Marula de Africa.</p>', 'Amarula, crema de licor destilada a partir de la misteriosa fruta Marula de Africa. Si de gusta el Baileys deberÃ­as probarlo.', 4, 72900, 1, 11, 'amarula-licor-de-frutas', 19, 0, 'Amarula Crema Licor de Frutas', 'Crema Amarula, Licor de Africa, Licor de Frutas, Bogota, Colombia, Amarula Crema de Licor, Amarula a Domicilio en Bogota', 'baileys beilis baylis bayleys beilays amarula veilis belis'),
(132, 'Oceanic Convier', '750 ml', '<p>Oceanic Convier, un aperitivo de licor ideal para dar ese color original a todo tipo de coctel. Con sabor a fruta tropical, vibra con su espectacular color azul.</p>', 'Oceanic Convier, una mezcla de licor y jugo de fruta tropical de color azul. ', 4, 48000, 1, 0, 'oceanic-convier', 12, 0, 'Oceanic Convier Aperitivo', 'Aperitivo de color azul licor azul, curacao blue, curaÃ§ao azul, convier oceanic, licor azul', 'convier conbier comvier combier oceanico'),
(9, 'Baileys', '700 ml', '<p>Crema de Whisky Baileys. Entre sus principales atractivos se encuentra su toque de crema de caramelo y cafÃ©.</p>\r\n<p>Actualmente se utilizan mÃ¡s de 275 millones de litros de leche irlandesa anualmente para producir la crema de Whisky Baileys<strong style=\"line-height: normal; text-align: justify;\">.Â </strong>Entre sus principales atractivos se encuentra su toque de crema de caramelo y cafÃ©.</p>', 'Crema de Whisky Baileys. Lanzada al Mercado en 1974 es una mezcla Ãºnica de frescura entre la crema de leche irlandesa y el whisky irlandÃ©s.', 10, 52900, 1, 56, 'baileys', 1, 0, 'Baileys | LaLicorera.com', 'Whisky, Crema, Baileys, Bogota. Colombia, domicilio', 'whiskey whisky wiskey wisky whyskey whysky wisqui uisqui uiski whiskhey wiskhey wiskhi wiskhy wyskey crema de baileys bayleys bayleis beileys beyleys beilis beilys baylis baylys beilais beilays beylais beylays baylays baylais leche irlandesa cafÃ© caramelo beylis bailys beilis bayleys baylys crema'),
(10, 'Smirnoff Ice', '275 ml', '<p>Smirnoff Ice, lo presentamos en LaLicorera.com en su versiÃ³n de lata.</p>\r\n<p>Smirnoff Ice, una de las propuestas mas famosos de cocteles pre-elaborados a base de vodka; comercializado por la casa de licores Diageo.</p>', 'Smirnoff Ice lata, una de las propuestas mas famosos de cocteles pre-elaborados a base de vodka; por la casa de licores Diageo.', 23, 6000, 1, 23, 'smirnoff-ice', 5, 0, 'Smirnoff Ice | LaLicorera.com', 'Smirnoff Ice lata, bogota, Colombia, Coctel con vodka', 'vodka bodka vodca bodca smirnoff esmirnoff esmirnov esmirnob ais ays ice yce aise ayse latas'),
(11, 'Beefeater ', '750 ml', '<!--[if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:PixelsPerInch>96</o:PixelsPerInch>\r\n  <o:TargetScreenSize>800x600</o:TargetScreenSize>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]-->\r\n<p>Beefeater. La ginebra Beefeater creada en 1820 por James Burrough, se considera una mezcla perfecta entre los elementos botÃ¡nicos y los granos. Su especial mÃ©todo de destilado, el cual le otorga toda la suavidad al trago sigue siendo su receta en la actualidad.</p>\r\n<p>Su sede se encuentra en su natal Londres, Inglaterra.</p>\r\n<p><!--[if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:AllowPNG/>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]--> <!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\r\n  <w:LidThemeAsian>JA</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:EnableOpenTypeKerning/>\r\n   <w:DontFlipMirrorIndents/>\r\n   <w:OverrideTableStyleHps/>\r\n   <w:UseFELayout/>\r\n  </w:Compatibility>\r\n  <m:mathPr>\r\n   <m:mathFont m:val=\"Cambria Math\"/>\r\n   <m:brkBin m:val=\"before\"/>\r\n   <m:brkBinSub m:val=\"--\"/>\r\n   <m:smallFrac m:val=\"off\"/>\r\n   <m:dispDef/>\r\n   <m:lMargin m:val=\"0\"/>\r\n   <m:rMargin m:val=\"0\"/>\r\n   <m:defJc m:val=\"centerGroup\"/>\r\n   <m:wrapIndent m:val=\"1440\"/>\r\n   <m:intLim m:val=\"subSup\"/>\r\n   <m:naryLim m:val=\