(72, 'Red Bull ', '250 ml', '<p>Red Bull, probablemente la bebida energÃ©tica mas famosa del mundo, debido a sus grandes patrocinios en deportes extremos y arios. Una bebida para todo tipo de ocasiÃ³n.</p>', 'Red Bull, bebida EnergÃ©tica, para todo tipo de ocasiÃ³n.', 11, 6500, 1, 34, 'red-bull', 7, 0, 'Red Bull | LaLicorera.com', 'Red Bull lata bebida energetica a domicilio en bogota', 'red bull vull redbull bebidas energÃ©ticas energizante'),
(73, 'Red Bull Libre de Azucar', '250 ml', '<p>Bebida EnergÃ©tica libre de azÃºcar, especial para toda ocasiÃ³n.</p>', 'Bebida EnergÃ©tica libre de azÃºcar, especial para toda ocasiÃ³n.', 11, 7000, 1, 20, 'redbulllibre-de-azucar', 7, 0, 'Red Bull Libre de azÃºcar bebida energÃ©tica en bogota a domicilio online', 'Red Bull Libre de azÃºcar bebida energÃ©tica en bogota a domicilio online', 'bebida energizante energÃ©tica libre sin no azÃºcar de redbull red bull vull '),
(74, 'Vodka Absolut Mandrin', '700 ml', '<p>Vodka Absolut Mandrin, es recomendado para los amantes de los licores cÃ­tricos. Es la base perfecta para preparar cocteles deliciosos, al igual que sirve como digestivo, pues se puede beber puro con abundante hielo.<span style=\"font-family: \'Lucida Grande\', arial; font-size: 11px; line-height: 17px;\"><br /></span></p>', 'Vodka Absolut Mandrin, un licor con aromas a naranja, mandarina y citricos. A diferencia de los otros vodkas saborizados, el Absolut Mandrin no tiene azucar.', 9, 74000, 1, 2, 'absolut-mandrin', 8, 0, 'Absolut Mandrin | LaLicorera.com', 'Vodka Absolut Mandrin en bogota a domicilio online Colombia', 'vodka bodka vodca bodca absolut asolut avsolut mandrin mandarin mandirin sin no azÃºcar'),
(75, 'Angostura (Esencias de gotas amargas)', '4 Oz', '<p>Angostura, definitivamente es el ingrediente perfecto para darle un toque especial de sabores a dsititnos cocteles realizados con Whiskey, ron, vodka y ginebra.</p>\r\n<p>Esta bebida es comercializada a nivel mundial en mas de 150 paises, fue creada en 1984 por Johann Gottlieb Benjamin, un doctor Aleman que trataba dolores de estÃ³mago e indigestiÃ³n en un hopital militar en la ciudad de Angostura, Venezuela; de alli su sombre.</p>', 'Angostura, bebida comercializada desde 1984 como esencia de gotas amargas para la creaciÃ³n de los mÃ¡s famosos cocteles a nivel mundial.\r\n\r\nSu contenido es secreto, pero tiene distintas notas a sabores de hierbas silvestres y frutas acidas.', 17, 74900, 1, 5, 'angostura', 2, 0, 'Cocteles con angostura o gotas amargas', 'Angostura, Colombia, Bogota, compra online, cocteles con angostura o gotas amargas', 'angostura anjostura gotas amargas amarjas esencias ecencias escencias cocteles');
