(60, 'Casillero Chardonnay', '750 ml + Bolsa Plegable', '<p>Este chardonnay de un suave color amarillo-verdoso con reflejos dorados, aroma a frutas maduras, suave acidez y frescura; se origina a base de uvas del Valle de Casablanca las cuales reciben privilegiadamente las frescas brisas del PacÃ­fico Sur, mientras desarrollan un estilo mineral Ãºnico gracias la composiciÃ³n de los suelos.</p>\r\n<p>Este vino de buena estructura, con excelente balance y viva acidez, tiene un final largo y seco donde aparecen notas a peras verdes y sutiles toques de durazno, complementados con notas tostadas. Es perfecto para acompaÃ±ar pescados delicados como corvina, lenguado y turbot, preparados a la plancha con salsas cremosas o hierbas.</p>', 'Este vino chileno Casillero Chardonnay de buena estructura, con excelente balance y viva acidez, tiene un final largo y seco donde aparecen notas a peras verdes y sutiles toques de durazno, complementados con notas tostadas. ', 8, 58600, 1, 17, 'casillero-chardonnay', 2, 0, 'Vino Chileno Casillero Chardonnay | LaLicorera.com', 'Vino Chileno, Casillero Chardonnay, a domicilio, en bogota online, Colombia', 'vinos chilenos casillero chardonnay chardonney chardonay chardoney chardonai chardonay blancos'),
(15, 'Ron Medellin', '1000 ml', '<p>Ron Medellin fabricado en los mÃ¡s selectos barriles de roble, este ron es un orgullo para Antioquia, debido a su exquisito sabor que puede ser degustado puro o combinado.</p>\r\n<p>El ron MedellÃ­n es obtenido de los jugos de la caÃ±a de azÃºcar, para luego ser aÃ±ejado en barriles de roble de forma natural por un mÃ­nimo de 3 aÃ±os.</p>', 'Ron Medellin fabricado en los mÃ¡s selectos barriles de roble, este ron es un orgullo para Antioquia, debido a su exquisito sabor que puede ser degustado puro o combinado.', 6, 51900, 1, 19, 'medellin', 4, 0, 'Ron Medellin | LaLicorera.com', 'Ron Medellin, Online, Bogota, Colombia, Domicilio', 'rones medellÃ­n antioquia 1 litro'),
(52, 'Cerveza Peroni', '330 ml', '<p>Cerveza Peroni, la famosa y tan alagada birra (cerveza en italiano), del tipo â€œlagerâ€, obtenida a partir de la mejor cebada, lÃºpulo y malta. Debe su nombre a su creador Giovanni Peroni en 1846. En el 2005 SABMiller adquiere la marca y para su relanzamiento se contrata una boutique de vacÃ­o en la 202 Sloane Street (Londres) cuyo nombre se titulÃ³ â€œEmporio Peroniâ€.</p>', 'Cerveza Peroni, la famosa y tan alagada birra (cerveza en italiano), del tipo â€œlagerâ€, obtenida a partir de la mejor cebada, lÃºpulo y malta. Debe su nombre a su creador Giovanni Peroni en 1846. ', 3, 4700, 0, 0, 'peroni', 1, 0, 'Cerveza Peroni | LaLicorera.com', 'Cerveza Peroni a domicilio en bogota online', 'cervezas polas chelas birras virras frÃ­as peroni peronni lager');
