(61, 'Frontera Merlot', '750 ml', '<p>Este vino chileno Frontera Merlot de carÃ¡cter frutal proviene del valle de Rapel, tierra donde se originan las uvas que maduran lentamente y, que luego de ser guardadas en tanques de acero durante dos meses, resultan en una particular versiÃ³n de este elegante clÃ¡sico mundial.</p>\r\n<p>El sello distintivo de este vino suave y fresco es su color rubÃ­ intenso. AdemÃ¡s, se caracteriza por su sabor elegante, con buen cuerpo y persistencia en la boca. En la nariz se perciben toques de pimienta y frutas rojas como cerezas; tambiÃ©n un suave toque a madera y cacao.</p>\r\n<p>Es especial para acompaÃ±ar pastas, quesos, carnes y pollo a la parrilla. Servir a temperatura ambiente (15Â°Â â€“ 20 Â°C).</p>', 'El sello distintivo de este vino chileno Frontera Merlot suave y fresco, es su color rubÃ­ intenso. Se caracteriza por su sabor elegante, con buen cuerpo y persistencia en la boca. En la nariz se perciben toques de pimienta y frutas rojas como cerezas; tambiÃ©n un suave toque a madera y cacao', 8, 35000, 1, 94, 'frontera-merlot', 2, 0, 'Vino Chileno Frontera Merlot | LaLicorera.com', 'Vino Chileno Frontera Merlot, en bogota, a domiclio onlline', 'fronteras vinos merlot merlod chileno tintos rojos'),
(62, 'Frontera Cabernet Sauvignon', '750 ml', '<p>Vino Frontera Cabernet Sauvignon de sabor suave y buen cuerpo, intenso color violeta, carÃ¡cter frutal y aromas a ciruela roja y chocolate. Considerado por expertos el vino del dÃ­a a dÃ­a; razÃ³n por la cual, es el ejemplar chileno mÃ¡s vendido a nivel mundial!</p>\r\n<p>En el paladar es un vino frutoso, armÃ³nico y con un agradable final. Es ideal para acompaÃ±ar carnes rojas, quesos, guisos condimentados y pastas con salsas especiadas. Se recomienda servir a temperatura ambiente (15Â°Â â€“ 20 Â°C).</p>', 'Vino Frontera Cabernet Sauvignon de sabor suave y buen cuerpo, intenso color violeta, carÃ¡cter frutal y aromas a ciruela roja y chocolate. Considerado por expertos el vino del dÃ­a a dÃ­a; razÃ³n por la cual, es el ejemplar chileno mÃ¡s vendido a nivel mundial!', 8, 35000, 1, 17, 'frontera-cabernet-sauvignon', 3, 0, 'Vino Chileno Frontera Sauvignon | LaLicorera.com', 'Vino Chileno, Frontera Cabernet Sauvignon, en bogota, a domicilio online', 'vinos tintos rojos fronteras cabernet cavernet caberned caberned sauvignon savignon suvignon sevignon sauviÃ±on saviÃ±on suviÃ±on seviÃ±on chileno'),
(63, 'Frontera Sauvignon Blanc', '750 ml', '<p>Vino chileno Frontera Sauvignon BlancÂ de color amarillo y ligeramente verde como la paja del campo, proveniente de los extensos valles del elegante Maule y el fresco CuricÃ³, en Chile. Lugares donde el intenso calor del dÃ­a se contrapone con el romanticismo de sus refrescantes noches; caracterÃ­stica inigualable que asegura la fantÃ¡stica expresiÃ³n frutal de este licor.</p>\r\n<p>Este vino fresco, liviano y explosivo de carÃ¡cter frutal y aromas cÃ­tricos y a durazno, es ideal para acompaÃ±ar mariscos, pescados con salsas livianas y ensaladas. De preferencia debe servirse frÃ­o (8Â°Â â€“ 10 Â°C).</p>', 'Vino chileno Frontera Sauvignon Blanc de color amarillo y ligeramente verde como la paja del campo, proveniente de los extensos valles del elegante Maule y el fresco CuricÃ³, en Chile. ', 8, 35000, 1, 35, 'frontera-sauvignon-blanc', 4, 0, 'Vino Chileno Sauvignon Blanco | LaLicorera.com', 'Vino Chileno Frontera Sauvignon Blanco, en bogota, a domicilio online', 'vinos chilenos frontera sauvignon savignon suvignon sevignon sauviÃ±on saviÃ±on suviÃ±on seviÃ±on blanc blank blanck blancos'),
(64, 'Santa Rita 120 Rosado', '750 ml', '<p class=\"MsoNormal\" style=\"text-align: justify;\">Alta calidad, dedicaciÃ³n y cuidado en cada detalle son las caracterÃ­sticas que destacan a Santa Rita, una de las bodegas mÃ¡s innovadoras y admiradas de Chile. La ediciÃ³n especial â€œ<em>120â€</em> fue nombrada en honor a los 120 soldados que se refugiaron en las bodegas de Santa Rita durante la guerra por la Independencia de Chile en 1814. Estos vinos son jÃ³venes, frescos, elegantes y frutosos; perfectamente balanceados con taninos suaves y buena acidez.Â </p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">El Vino Rosado Santa Rita 120 es ligero, de acidez refrescante y muy perfumado en la boca; es de un intenso color rojo violÃ¡ceo y tiene muchos aromas de cerezas, ciruelas y algunos frutos del bosque. EstÃ¡ compuesto por 90% Cabernet Sauvignon y 10% Syrah. Es ideal para acompaÃ±ar comidas livianas, ensaladas, quesos suaves y/o postres con crema como tartaletas de frutas, strudel o pie.</p>\r\n<p>Â </p>', 'El Vino Rosado Santa Rita 120 es ligero, de acidez refrescante y muy perfumado en la boca; es de un intenso color rojo violÃ¡ceo y tiene muchos aromas de cerezas, ciruelas y algunos frutos del bosque. ', 8, 45000, 1, 7, 'santarita120rosado', 5, 0, 'Vino Chileno Santa Rita 120 rosado en bogota a domicilio online', 'Vino Chileno Santa Rita 120  rosado,en bogota, a domicilio online', 'vinos rosados rose santa rita 120'),
(65, 'Santa Rita Medalla Real Syrah', '750 ml', '<p class=\"MsoNormal\" style=\"text-align: justify;\">El Syrah es de un color rubÃ­ profundo con tonos violÃ¡ceos. Su complejo bouquet Â combina aceitunas, frutas frescas negras y algo de especias. En el paladar es elegante y concentrado, fresco, de gran equilibrio y con un grato y largo final. Es ideal para acompaÃ±ar carnes rojas, cerdo, pastas y quesos.</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">Vino chileno Sta. Rita Medalla Real Syrah de estilo intenso, frutoso y bien estructurado; los vinos Medalla Real reflejan claramente las caracterÃ­sticas de sabor y aroma propios de cada variedad. Elegantes y complejos, poseen muy buena estructura, concentraciÃ³n y persistencia.</p>', 'Vino chileno Santa. Rita Medalla Real Syrah de estilo intenso, frutoso y bien estructurado; los vinos Medalla Real reflejan claramente las caracterÃ­sticas de sabor y aroma propios de cada variedad. ', 8, 96000, 0, 1, 'santarita-medalla-real-syrah', 6, 0, 'VinoSanta Rita Medalla Real | LaLicorera.com', 'Vino Chileno Santa Rita Medalla Real Syrah, en bogota, a domiciliol online', 'vinos chilenos santa rita medalla real syrah sirah syrha sirha tintos rojos'),
(277, 'Cerveza Corona', '710ml', '<p>La Cerveza Corona Extra es de origen mexicano. Mundialmente conocida ya que se distribuye en mÃ¡s de 170 paÃ­ses. Se elabora desde 1925. Es la cerveza mÃ¡s vendida en MÃ©xico y la mÃ¡s importada en Estados Unidos.</p>', 'La Cerveza Corona Extra es de origen mexicano. Mundialmente conocida ya que se distribuye en mÃ¡s de 159 paÃ­ses.', 3, 7500, 1, 8, 'corona-710ml', 13, 0, 'Cerveza Corona 710ml | LaLicorera.com', 'cerveza, corona, 710', 'cervezas polas chelas birras virras frÃ­as corona extra 710 mililitros ml botellas'),
