(68, 'Jagermeister ', '700 ml', '<!--[if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:AllowPNG/>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]-->\r\n<p>El <a title=\"Jagermeister Bogota\" href=\"https://www.lalicorera.com/blog/jagermeister-en-bogota\" target=\"_self\">Jagermeister</a>, se recomienda almacenarlo en el congelador con la tranquilidad que no se va a congelar y servirlo solo en una copa aguardentera o mezclarlo con agua tÃ³nica, limonada o <a title=\"COCA-COLA\" href=\"http://www.lalicorera.com/productos/no-alcoholicas/coca-cola-1-75l\" target=\"_blank\">Coca-Cola</a>. TambiÃ©n se puede mezclar con <a title=\"Red Bull\" href=\"http://www.lalicorera.com/productos/no-alcoholicas/red-bull\" target=\"_blank\">Red Bull</a>, creando asÃ­ el famoso <a title=\"Jagerbomb\" href=\"http://www.lalicorera.com/cocteles/jagerbomb\" target=\"_blank\">JÃ¤ger Bomb</a>.</p>\r\n<p>JÃ¤germeister significa \"Maestro de la caza\"; su logo, una cabra que entre sus cuernos tiene una cruz, hace homenaje a San Hubert, el patrÃ³n de los cazadores. Se dice que en la Ã©poca de caza durante el invierno los cazadores acostumbran beber varios shots de este licor, con el fin de aumentar su suerte.</p>\r\n<!--EndFragment-->\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph;\">Â </p>\r\n<!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\r\n  <w:LidThemeAsian>JA</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWith