(19, 'Ron Zacapa 23 aÃ±os', '750 ml', '<p>El perfecto aÃ±ejamiento del Ron Zacapa 23 aÃ±os le otorga un color caramelo que combina a la perfecciÃ³n con las diferentes sensaciones que ofrece este licor. Iniciando con los sutiles aromas a caramelo, vainilla y cacao, combinado con un equilibrado sabor a frutas pasas y conservas de albaricoque, que se combinan con notas de cafÃ©, canela y jengibre, ligados al leve sabor de banano y piÃ±a seca provenientes de los barriles en el que fue almacenado y que con anterioridad habÃ­an almacenado whisky Americano</p>', 'Ron Zacapa 23 aÃ±os considerado un ron para paladares refinados, el Ron Zacapa 23 aÃ±os es un licor que posee una viscosidad poco comÃºn en las bebidas aÃ±ejadas por mÃ¡s de 10 aÃ±os, con un toque dulce amielado combinado con suaves notas de jerez.', 6, 153900, 1, 23, 'ron-zacapa-23-anos', 2, 0, 'Zacapa 23 aÃ±os | LaLicorera.com ', 'Rona Zacapa 23 aÃ±os, bogota, colombia, online, domicilios', 'rones zacapa sacapa 23 aÃ±os'),
(20, 'Ron Zacapa XO', '750 ml', '<p>Ron Zacapa XO aÃ±ejado por mÃ¡s de 23 aÃ±os el Ron Zacapa XO es un deleite para los sentidos, con un proceso de aÃ±ejamiento en barriles de roble francÃ©s que anteriormente han contenido cognac, su sabor es una combinaciÃ³n de frutas dulces secas con chocolate negro, vainilla, clavos y canela, terminado con un toque de jengibre que resalta el aroma a roble tostado, caramelo tostado y cÃ¡scara de naranja.</p>', 'Ron Zacapa XO Considerado una obra de arte realizada por la Maestra Ronera Lorena VÃ¡squez, un deleite para los conocedores. Con sus toques dulces y notas frutales hace que este trago de color caoba rojizo sea un tesoro para su dueÃ±o.', 6, 412900, 1, 2, 'zacapa-xo', 6, 0, 'Zacapa XO | LaLicorera.com', 'Ron Zacapa XO, bogota, colombia, online, domicilios', 'rones zacapa sacapa xo ronera lorena vasquez vasques vazquez vazques basquez basques'),
(21, 'Ron Bacardi AÃ±ejo', '750 ml', '<p>Los creadores del Ron Bacardi aÃ±ejo fueron Don Facundo BacardÃ­ y JosÃ© LeÃ³n Bouteiller un francÃ©s que vivÃ­a en Cuba el cual tenÃ­a un poco de conocimiento sobre el tema y con quien fue posible crear el ahora reconocido ron Bacardi.</p>\r\n<p>En la actualidad, la familia Bacardi continÃºa con el negocio del ron lo que ha permitido consolidar la marca como una de las mÃ¡s antiguas y prestigiosas del mundo</p>', 'El Ron Bacardi aÃ±ejo fue creado en 1862, Bacardi aÃ±ejo es el ron original de la casa, con un cuerpo y sabor suave que resalta su aÃ±ejamiento en barriles de madera que puede llegar a ser de hasta 3 aÃ±os.', 6, 48000, 1, 20, 'bacardi-anejo', 6, 0, 'Bacardi AÃ±ejo | LaLicorera.com', 'Ron Bacardi aÃ±ejo, bogota, colombia, online, domicilios', 'rones bacardÃ­ vacardi aÃ±ejo poker'),
