(426, 'MÃ¶et &amp; Chandon RosÃ© Imperial x 2', '750 ml', '<p>La Champagne MÃ¶et &amp; Chandon se distingue por un color radiante, una intensa frutosidad y una extravatgancia Ãºnica en el paladar; reflejando la diversidad de sus tres tipos de uvas: Pinot Noir, Pinot Meunier y Chardonnay.</p>\r\n<p>MÃ¶et &amp; Chandon (M&amp;C) es la marca NÂ° 1 a nivel mundial, ademÃ¡s deser la mÃ¡s innovadora y exitosa de la historia. Se producen mÃ¡s de 30 millones de botellas al aÃ±o... cada tres segundos alguien descorcha una botella de champaÃ±a de esta casa.</p>', 'La Champagne MÃ¶et &amp; Chandon RosÃ© Imperial es la expresiÃ³n mÃ¡s glamurosa y seductora del estilo MÃ¶et &amp; Chandon, la cual llega como una invitaciÃ³n especial al amor.', 16, 640000, 0, 12, 'moet-chandon-rose-imperial-x-2', 5, 0, 'MÃ¶et &amp; Chandon RosÃ© Imperial x 2', 'ChampaÃ±a, Moet &amp; Chandon, Rose, Imperial, Bogota, Colombia', 'champagne champaÃ±a shampaÃ±a shampagne moet y &amp; chandon shandon rose rosÃ© rosada rosado amor'),
(427, 'Olmeca Plata', '700 ml', '<p>Tequila de deliciosas y refrescantes notas herbales, complementado con un toque de pimiento verde y un suave final cÃ­trico.Â </p>', 'Tequila Olmeca Blanco - Plata.', 7, 60500, 1, 8, 'olmeca-plata-blanco', 3, 0, 'Olmeca Plata', 'Tequila Olmeca, Olmeca Plata, Bogota, Colombia, Coctel Palomita, Coctel Paloma', 'tequila olmeca olmeka plata blanco nuevosprecios'),
(22, 'Bacardi Mojito', '750 ml', '<p>AhorrÃ¡ndoles tiempo a los amantes del ron, Bacardi Mojito es la compaÃ±Ã­a perfecta en cualquier evento.Â </p>\r\n<p>Con el clÃ¡sico sabor a limÃ³n y menta combinados con Ron Bacardi Superior usted solo necesita agregar hielo y disfrutar de este coctel tÃ­pico de cuba.Â </p>', 'Bacardi Mojito, ahorrÃ¡ndoles tiempo a los amantes del ron, Bacardi Mojito es la compaÃ±Ã­a perfecta en cualquier evento.', 6, 49900, 1, 21, 'bacardi-mojito', 7, 0, 'Bacardi Mojito | LaLicorera.com', 'Bacardi Mojito, bogota, Colombia, online, domicilios', 'bacardÃ­ vacardi mojito rones coctel'),
(23, 'Ron Havana AÃ±ejo Especial', '750 ml', '<p>Havana AÃ±ejo Especial es considerado como una obra maestra, el Ron Havana AÃ±ejo Especial es aÃ±ejado durante 5 aÃ±os en barriles de aÃ±ejamiento que son constantemente supervisados por el Maestro Ronero Don JosÃ© Navarro, para asÃ­ obtener un producto lleno de sensaciones intensas, un poco de saborÂ ahumado y remata con toques de caÃ±a de azÃºcar, notas de miel, vainilla y canela.</p>', 'Havana AÃ±ejo Especial es un ron Premium con un sabor intenso que resalta la vivacidad de los rones blancos con el aroma marcado de los rones oscuros, perfecto para tomar solo o en coctel.\r\n', 6, 55900, 1, 24, 'havana-anejo-especial', 8, 0, 'Ron Havana AÃ±ejo Esoecial | LaLicorera.com', 'Ron Havana AÃ±ejo Especial, bogota, colombia, online, domicilios', 'havana aÃ±ejo habana especial rones cuba premium'),
(24, 'Ron Havana Club 7 aÃ±os', '750ml', '<p>Havana Club AÃ±ejo es realizado como un homenaje al arte de hacer ron cubano, el Havana Club 7 aÃ±os se aÃ±eja en barriles de roble blanco que acentÃºan los sabores del cacao la vainilla, la caÃ±a de azÃºcar y frutas tropicales caramelizadas que se usan en su preparaciÃ³n, un orgullo para la tradiciÃ³n ronera de Cuba.</p>', 'Havana Club 7 AÃ±os es reconocido como uno de los mejores rones del mundo, el Ron Havana Club AÃ±ejo 7 aÃ±os es el sÃ­mbolo de la excelencia en la preparaciÃ³n del ron cubano, con su aÃ±ejamiento en barriles de roble blanco, acentÃºa su sabor fuerte y complejo.', 6, 77900, 1, 24, 'havana-club-7anos', 8, 0, 'Ron Havana club 7 aÃ±os | LaLicorera.com', 'Ron Havana 7 aÃ±os, club, online, domicilio', 'habana havana club 7 siete aÃ±os cuba nuevosprecios'),
(55, 'Cerveza Club Colombia Roja', '330 ml', '<p>Una cerveza elaborada con una exclusiva selecciÃ³n de malta tostada, lÃºpulo importado y elaborado por los mÃ¡s conocedores maestros Club Colombia.</p>\r\n<p>Cerveza Club Colombia Roja, fue lanzada al mercado a finales del 2010, para conmemorar las fiestas navideÃ±as. Sin embargo, dada su acogida en el pÃºblico se decidiÃ³ continuar con su comercializaciÃ³n.</p>', 'Cerveza Club Colombia Roja, fue lanzada al mercado a finales del 2010, para conmemorar las fiestas navideÃ±as. Sin embargo, dada su acogida en el pÃºblico se decidiÃ³ continuar con su comercializaciÃ³n.', 3, 3000, 1, 35, 'club-colombia-roja', 19, 0, 'Cerveza Club Colombia Roja | LaLicorera.com', 'Cerveza Club Colombia Roja en bogota a domicilio online', 'cervezas polas chelas birras virras frÃ­as club colombia roja latas'),
(27, 'Buchanans 18 aÃ±os ', '750 ml + Kit de Regalo Copas LeÃ³n', '<p>Whisky Buchanans 18 aÃ±os, es un whisky que se recomienda tomar solo para percibir toda su riqueza y cremosidad. Ingresa las rocas al congelador durante 4 horas y despues sumergelas en tu whisky para enfriarlo sin modificar su sabor.</p>\r\n<p>Aunque para algunas personas tomarlo solo puede ser demasiado, se recomienda agregar un poco de <a title=\"Agua Evian\" href=\"../productos/otrasbebidas/aguaevian\" target=\"_self\">Agua Evian</a> para abrirlo un poco y hacer que sea mas fÃ¡cil beberlo.</p>', 'Whisky Buchanans 18 aÃ±os, Esta ediciÃ³n especial con 18 aÃ±os de aÃ±ejamiento, se compone de los whiskies de malta utilizados por Buchananâ€™s en su reserva de &quot;12 Years Old De Luxe&quot;. Dicha mezcla se perfecciona con maltas adicionales que le otorgan una sutil distinciÃ³n de tono y textura.', 10, 204900, 1, 7, 'buchanans-18-anos', 2, 0, 'Buchanans | LaLicorera.com', 'Whisky Buchanans 18 aÃ±os', 'Scotch whiskey whisky wiskey wisky whyskey whysky wisqui uisqui uiski whiskhey wiskhey wiskhi wiskhy wyskey buchananss buchannanss bukananss buchanass buchannass bucanass bucananss 18 aÃ±os anos '),
(28, 'Chivas 12 aÃ±os', '750ml ', '<p>Whisky Chivas 12; en el corazÃ³n de la mezcla de Chivas Regal se encuentra la excepcional malta de Strathisla y su historia de hermandad, artesanÃ­a y generosidad. En las puertas de nuestra destilerÃ­a, ubicada en lo profundo de las tierras altas de Escocia, se forja un eterno tributo al amor y a la lealtad; a dos corazones unidos con una corona. Un homenaje al compromiso perdurable de nuestros hermanos fundadores, James y John Chivas, para elaborar los whiskies escoceses de mezcla mÃ¡s finos del mundo. Cada gota de Chivas Regal 12 AÃ±os ha sido expertamente mezclada para crear un whisky de lujo superior.</p>', 'Whisky Chivas 12, es una mezcla de whiskies de malta y grano escoceses que han sido madurados por al menos 12 aÃ±os. Esta mezcla suave y generosa balancea el estilo con la sustancia y la tradiciÃ³n con un toque moderno, con notas de miel, avellana y caramelo', 10, 109000, 1, 9, 'chivas-12-anos', 2, 0, 'Whisky Chivas 12 aÃ±os | LaLicorera.com', 'Whisky Chivas 12 aÃ±os, a domicilio, online, en Bogota, Colombia', 'whiskey whisky wiskey wisky whyskey whysky wisqui uisqui uiski whiskhey wiskhey wiskhi wiskhy wyskey chivas chibas doce 12 aÃ±os anos diamujer');
