(30, 'Old Parr 12 aÃ±os ', '750ml', '<p>Whisky Old Parr, se dice fue creado por el hombre mas viejo que haya vivido en el Reino Unido Thomas Parr de 153 aÃ±os al que se conocÃ­a comoThe Grand Old Parr.</p>\r\n<p>Whisky Premium que se obtiene de las maltas de Rangganmore y Glendullan . Forma parte de la casa Diageo y es uno de los tragos mas comercializados en Japon, Mexico, Colombia y Venezuela.</p>', 'Whisky Old Parr, se dice fue creado por el hombre mas viejo que halla vivido en el Reino Unido Thomas Parr de 153 aÃ±os al que se conocÃ­a comoThe Grand Old Parr.', 10, 109900, 1, 48, 'old-parr', 2, 0, 'Old Parr | LaLicorera.com', 'Whisky Old Parr online a domicilio en Bogota Colombia', 'Scotch whiskey whisky wiskey wisky whyskey whysky wisqui uisqui uiski whiskhey wiskhey wiskhi wiskhy wyskey old parr olpar oldparr'),
