(33, 'Glenfiddich 12 aÃ±os ', '750ml', '<p>La destilerÃ­a Glenfiddich fue fundada enÂ 1886Â  por William Grant y su primer gota de whisky Glendfiddich saliÃ³ de los alambiques de la destilerÃ­a el dÃ­a de Navidad de 1887.</p>\r\n<p>Glenfiddich significa<strong> â€œ</strong><em style=\"line-height: normal; text-align: justify;\">Valle de los ciervosâ€</em>Â en GaÃ©lico es una destilerÃ­a deÂ whisky escocÃ©sÂ deÂ malta. Actualmente pertenece a la sociedad Â William Grant &amp; Sons.</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; line-height: normal;\">El whisky Glenfiddich usa una fuente natural de agua del manantial de Robbie Dhu y ademÃ¡s es madurado en barricas de roble, como los barriles deÂ ronÂ de Cuba dÃ¡ndole un toque enmaderado Ãºnico.</p>', 'Whisky Glenfiddich significa â€œValle de los ciervosâ€ en GaÃ©lico es una destilerÃ­a de whisky escocÃ©s de malta. Actualmente pertenece a la sociedad  William Grant &amp; Sons.', 10, 124000, 1, 7, 'glenfiddich-12-anos', 3, 0, 'Glenfiddich | LaLicorera.com', 'Whisky Glenfiddich 12 aÃ±os, precio, a domiclio, en Bogota, online, Colombia, Glenfiddich, 12 aÃ±os', 'whiskey whisky wiskey wisky whyskey whysky wisqui uisqui uiski whiskhey wiskhey wiskhi wiskhy wyskey glenfiddich glenfidich glenfiddish glenfidish glenffiddich glenffidich glenffidish glenffidich 12 doce aÃ±os anos'),
(93, 'Glenfiddich 18 aÃ±os 750 ml', '+ Mini 18 aÃ±os', '<p>Glenfiddich 18 aÃ±os, single malt, producido en pequeÃ±os lotes numerados individualmente, reconocido en el mundo por su sabor excepcional, debido a su aÃ±ejamiento en barricas de Bourbon americano y Â barriles de jerez.</p>\r\n<p>Â </p>', 'Glenfiddich 18 aÃ±os, producido en pequeÃ±os lotes numerados individualmente, reconocido en el mundo por su sabor excepcional, debido a su aÃ±ejamiento en barricas de bourbon americano y  barriles de jerez.', 10, 289000, 1, 4, 'glenfiddich-18-anos', 26, 0, 'Glenfiddich 18 aÃ±os | LaLicorera.com', 'Glenfiddich 18 aÃ±os en BogotÃ¡ a domicilio, licores a domicilio', 'whiskey whisky wiskey wisky whyskey whysky wisqui uisqui uiski whiskhey wiskhey wiskhi wiskhy wyskey glenfiddich glenfidich glenfiddish glenfidish glenffiddich glenffidich glenffidish glenffidich 18 aÃ±os anos'),
(35, 'Don Julio Reposado ', '750 ml', '<p>Tequila Don Julio Reposado, un tequila considerado Revolucionario debido a su forma de reposarce o aÃ±ejarse, ya que para tal proceso son utilizados barriles Americanos donde antes se elaboraba el conocido Whiskey, como el Â <a title=\"Jack Daniels\" href=\"http://www.lalicorera.com/productos/whisky/jackdaniels\" target=\"_self\">Jack Daniels</a>. Ahora realiza tu mezcla con la Sangrita Chapala, y crea el famoso coctel Bloody Mary.</p>', 'Tequila Don Julio Reposado, lanzado al mercado en 1996. Su nombre se da en honor a su creador Don Julio Gonzalez Estrada. Este tequila es aÃ±ejado de entre 18 meses a 2 aÃ±os en barriles donde se hacia el Whisky de Tennesse; como el Jack Daniels', 7, 154900, 1, 21, 'don-julio-reposado', 1, 0, 'Tequila Don Julio Reposado | LaLicorera.com', 'Tequila Don Julio Reposado, bogota. a domicilio, online', 'tequilas don julio reposado ');
