(36, 'Herradura AÃ±ejo', '750 ml', '<p>Tequila Herradura AÃ±ejo, su producciÃ³n inicialmente fue derivada un 100% de agave azul weber. En la <strong style=\"line-height: normal;\">Hacienda San JosÃ© del Refugio</strong>, todavÃ­a se pueden apreciar los antiguos hornos de piedra y los alambiques de cobre, tradicionales en la producciÃ³n de tequila.</p>\r\n<p>Casa Herradura es la Ãºnica destiladora que ha mantenido como norma sÃ³lo la venta nacional y de exportaciÃ³n de tequila embotellado de origen; y eso le ha dado una gran presencia en el mundo.</p>', 'Tequila Herradura AÃ±ejo, producido desde 1870 por FÃ©lix LÃ³pez quien desde entonces registrÃ³ a la Hacienda San JosÃ© del Refugio como lugar de producciÃ³n de tequila. Es el Ãºnico tequila en el mundo 100% producido en una hacienda', 7, 199000, 1, 2, 'herradura-anejo', 10, 0, 'Tequila Herradura AÃ±ejo | LaLicorera.com', 'Tequila Herradura AÃ±ejo a domicilio online en Bogota', 'tequilas herradura aÃ±ejo'),
(82, 'Coca-Cola', '1.75 Litros', '<p>Coca-Cola 1.75 Litros es la presentaciÃ³n ideal de la bebida mas famosa del mundo, para acompaÃ±ar todo tipo de evento o reuniones con los amigos, familia y personas allegadas.</p>\r\n<p>Igualmente recurda que la Coca-Cola es uno de los ingredientes fundamentales para disfrutar cocteles que te presentamos en LaLicorera.com como: el <a title=\"\\\" href=\"\\\" target=\"\\\">JackDaniels and Coke</a>, <a title=\"\\\" href=\"\\\" target=\"\\\">Long Island Ice Tea</a>, <a title=\"Coctel Black Russian\" href=\"http://www.lalicorera.com/cocteles/black-russian\" target=\"_blank\">black russian</a>, entre otros.</p>', 'Coca-Cola 1.75 Litros, una de las presentaciones mas vendidas de la bebida mas famosa del mundo. Adquierala a domicilio en LaLicorera.com.', 11, 6000, 1, 33, 'coca-cola-1-75l', 8, 0, 'Coca- Cola 1.75L | LaLicorera.com', 'Bebida Coca Cola 1.75L, licores y bebidas no alcoholicas a domicilio', 'coca cola cocacola coke 1.75 litros 1750 mililitros bebidas gaseosas'),
(37, 'Jimador Reposado', '750 ml', '<p>Tequila Jimador Reposado, La calidad del tequila proviene de los jimadores, los hombres que lo cosechan. Jimador es el nombre que se le da al maestro cosechador de las plantas de agave utilizadas para producir el tequila.</p>', 'Tequila Jimador Reposado, La calidad del tequila proviene de los jimadores, los hombres que lo cosechan. Jimador es el nombre que se le da al maestro cosechador de las plantas de agave utilizadas para producir el tequila.', 7, 79900, 1, 11, 'jimador-reposado', 11, 0, 'Tequila Jimador Reposado | LaLicorera.com', 'Tequila Jimador Reposado en BogotÃ¡ a domiclio online', 'tequilas jimador reposado'),
(38, 'Patron XO CafÃ©', '750 ml', '<p>Tequila Patron XO CafÃ©, es un tequila producido enÂ MÃ©xico, su creador es el SeÃ±or Francisco Alcaraz quien no solo busca una producciÃ³n limpia con el ambiente sino que tambiÃ©n sea sostenible para los habitantes de la regiÃ³n de Jalisco donde se produce; por esto es un producto supremamente artesanal debido a que sus botellas son sopladas a mano y enumeradas individualmente.</p>', 'Tequila Patron XO CafÃ©, Tequila  Ultra-Premium hecho totalmente de agave azul, con un sabor seco y poco dulce a pesar de tener la mezcla de cafÃ© con dulces notas de chocolate y vainilla. ', 7, 115000, 1, 1, 'patron-xo-cafe', 13, 0, 'Patron XO CafÃ© | LaLicorera.com', 'Tequila Patron XO CafÃ© a domicilio en bogota online', 'tequilas patrÃ³n xo cafÃ© premium'),
(39, 'Vodka Absolut Citron', '700 ml', '<p>Vodka Absolut Citron, vodka elaborado Â con extractos de mandarina, naranja, limÃ³n, lima y toronja. Lanzado al mercado en 1989, abriÃ³ el camino a los licores cÃ­tricos saborizados, y es uno de los elementos fundamentales en la elaboraciÃ³n del <a title=\"Coctel Cosmopolitan\" href=\"http://www.lalicorera.com/cocteles/cosmopolitan\" target=\"_self\">coctel Cosmopolitan</a>.Â </p>', 'Vodka Absolut Citron, vodka elaborado  con extractos de mandarina, naranja, limÃ³n, lima y toronja. Lanzado al mercado en 1989, abriÃ³ el camino a los licores cÃ­tricos saborizados, y es uno de los elementos fundamentales en la elaboraciÃ³n del coctel Cosmopolitan. ', 9, 74000, 1, 2, 'absolut-citron', 6, 0, 'Absolut citron | LaLicorera.com', 'Vodka Absoluto Citron en bogota a domicilio online', 'vodka bodka vodca bodca absolut asolut avsolut citron sitron'),
(40, 'Vodka Absolut Raspberri', '700 ml', '<p>Vodka Absolut Raspberri, aunque muchos crean que es un error ortogrÃ¡fico, no lo es, esta es la forma de recordar el origen del Absolut, el cual es Suecia. Este vodka posee infusiones de moras silvestres encontradas en las montaÃ±as de Suecia. Absolut Raspberri es lanzado al mercado en el 2004.</p>', 'Vodka Absolut Raspberri, aunque muchos crean que es un error ortogrÃ¡fico, no lo es, esta es la forma de recordar el origen del Absolut, el cual es Suecia. ', 9, 74000, 1, 7, 'absolut-raspberri', 7, 0, 'Absolut Raspberri | LaLicorera.com', 'Vodka Absolut Raspberri en bogota a domicilio online', 'vodka bodka vodca bodca absolut asolut avsolut raspberri raspberry rapberry rapberri rasberri rasberry raspverri raspverri raspberi raspveri'),
