(89, 'The Balvenie 12 aÃ±os', '750 ml', '<p>The Balvenie 12 aÃ±os, es un whisky escocÃ©s aÃ±ejado en barricas donde se almacenaba \"bourbon\", donde despues es transferido a barriles de roble de jerez donde es aÃ±ejado nuevamente durante 9 meses, de ahi su slogan \"Doble Wood\". Cabe resaltar que The Balvenie es un whisky \"Single malt\" y fue uno de los precursores en el sector referente a los metodos de eleboraciÃ³n con respecto a la siembra y tratamiento de la malta con la cual es hecho.</p>', 'The Balvenie 12 aÃ±os, un whisky escocÃ©s 100% artesanal reconocido a nivel mundial por su sabor inigualable y elegante textura; caracterÃ­sticas adquiridas por su elaboraciÃ³n tradicional. ', 10, 196200, 1, 6, 'the-balvenie', 23, 0, 'The Balvenie whisky | LaLicorera.com', 'Whisky the balvenie 12 aÃ±os en bogota', 'whiskey whisky wiskey wisky whyskey whysky wisqui uisqui uiski whiskhey wiskhey wiskhi wiskhy wyskey the de balvenie valvenie valbenie balvennie balvene valvene balbene 12 aÃ±os anos doce'),
(90, 'Gvine', '750 ml', '<p>El Ginebra Gvine, es reconocido en el mundo por utilizar las flores de uva como uno de sus ingredientes botÃ¡nicos.</p>\r\n<p>Lanzado al mercado de Estados Unidos en el 2006, ha ganado distintos premios y reconocimientos en el ambito mundial; gracias a su producciÃ³n artesanal y combinaciÃ³n de ingredientes botÃ¡nicos que lo hacen un ginebra exclusivo y perfeto para combinar con agua tonica para crear el famoso coctel <a title=\"Gin-and-tonic\" href=\"http://www.lalicorera.com/cocteles/gin-and-tonic\" target=\"_blank\">Gin &amp; Tonic</a>.</p>', 'Ginebra Gvine Floraison, famosa en el mundo por uno de sus principales ingredientes  la &quot;fleurs de vigne&quot; - flores verdes del Ã¡rbol de uva de Francia.', 5, 199000, 1, 0, 'gvine-floraison', 5, 0, 'Ginebra G-Vine Floraison | LaLicorera.com', 'Ginebra de francia Gvine Floraison en bogotÃ¡, licores a domicilio', 'ginebra jinebra g vine gvine floraison florason florison bine vain'),
(374, '2 Absolut 750 ml +', '1/2 Dubonnet Gratis', '<p>Compra 2 botellas de absolut vodka de 750ml y lleva gratis 1/2 botella de Dubonnet.</p>', 'Compra 2 botellas de absolut vodka de 750ml y lleva gratis 1/2 botella de Dubonnet.', 24, 138000, 0, 11, '2-absolut-dubonnet', 4, 0, 'Absolut Dubonnet', 'Absolut, Dubonnet, BogotÃ¡, Colombia', 'Absolut vodka dubonnet'),
(91, 'Fever-Tree Agua TÃ³nica IndÃº', ' 4 x 200 ml ', '<p>Fever-Tree Agua tÃ³nica Indu Premium, es hecha a base de aceites de naranja de Tanzania exprimidos manualmente, agua manantial y un poco de quinina obtenida del Ã¡rbol de la fiebre (de allÃ­ su nombre) del Congo y Ruanda. Esta bebida es especial para mezclarla con los mejores ginebras o vodkas; al igual que puede ser bebida sola como un pasante refrescante.Â Â No contiene edulcorantes artificiales ni conservantes. SegÃºn <a title=\"Ferran-AdriÃ \" href=\"http://es.wikipedia.org/wiki/Ferran_Adri%C3%A0\" target=\"_blank\">Ferran AdriÃ¡</a>Â Fever Tree es el agua toncia perfecta para hacer un <a title=\"Gina-and-tonic\" href=\"http://www.lalicorera.com/cocteles/gin-and-tonic\" target=\"_blank\">gin and tonic</a>.</p>\r\n<p>Â </p>', 'Fever-Tree Agua tÃ³nica Indu Premium, una excelente mezcla de aromas y sabores botÃ¡nicos, recomendada para hacer un perfecto gin and tonic o saborizar de una forma Ãºnica los mas refinados vodkas.', 11, 26000, 1, 100, 'fever-tree-agua-tonica-indu', 2, 0, 'Fever Tree Agua Tonica Indu | LaLicorera.com', 'Agua tonica indu en Bogota, licores y bebidas a domicilio, agua tonica indu para mezclar con ginebra', 'fever tree fiver feber fiber tree tri agua tÃ³nica premium');
