(133, 'Cerveza Buckler Sin Alcohol', '330 ml', '<p>Cerveza Buckler sin alcohol, de color dorado, sabor suave y ligero. Buckler es la cerveza perfecta que encaja para todo tipo de ocasiÃ³n y que se puede disfrutar sin moderaciÃ³n.</p>', 'Buckler sin alcohol, es una cerveza 100% de malta, elaborada con la selecciÃ³n de los mejores ingredientes naturales: agua, malta, lÃºpulo y levadura. ', 3, 3900, 0, 12, 'cerveza-buckler-sin-alcohol', 8, 0, 'Cerveza sin alcohol ', 'Cerveza sin alcohol, bogota, cerveza cero grados acohol, cerveza lager sin alcohol, cerveza importada sin alcohol, cerveza Holandesa sin alcohol', 'buckler bucler bukler cerveza latas sin no alcohol alcol alcool alcoohl cervezas polas chelas birras virras frÃ­as'),
(77, 'Vodka Absolut Kurant', '700 ml', '<p>El Vodka Absolut Kurant, es reconocido mundialmente por su sabor a mora negra, y por ser el ingrediente principal del coctel \"Metropolitan\".Â </p>\r\n<p>Un coctel inventado en 1993 en Nueva York, mas exactamente conocido como la variaciÃ³n del coctel <a title=\"Coctel Cosmopolitan \" href=\"http://www.lalicorera.com/cocteles/Cosmopolitan\" target=\"_blank\">cosmopolitan</a>, pero en lugar de agregar a la mezcla <a title=\"Absolut citron\" href=\"http://www.lalicorera.com/productos/vodka/vodkaabsolutcitron\" target=\"_blank\">absolut citron</a>Â se agrega el Absolut Kurant.</p>', 'Vodka absolut kurant, es un vodka saborizado con extracto de moras negras, cultivadas en el norte de Suecia. \r\n\r\nFue lanzado en 1992 en Nueva York con el fin de hacer una variaciÃ³n del coctel cosmopolitan.', 9, 74000, 1, 1, 'absolut-kurant', 9, 0, 'absolut kurant | LaLicorera.com', 'licores a domicilio, cocteles con vodka, receta de cocteles con vodka, vodka con sabor a uva', 'vodka bodka vodca bodca absolut asolut avsolut suecia kurant curant kurand curand metropolitan cosmopolitan'),
(81, 'Milagro Reposado', '750 ml', '<p>El Tequila Milagro Reposado, dada su forma de aÃ±ejamiento provee al paladar del consumidor un balance entre el sabor del roble y el agave. Este Tequila es reconocido en el mercado por su color dorado y sus notas con sabor a caramelo que se pueden degustar al momento de beberlo.</p>', 'Tequila Milagro Reposado, extraÃ­do 100% de agave azul, es aÃ±ejado 6 meses en barriles de roble (casi 4 meses mÃ¡s que los otros reposados del mercado). ', 7, 125000, 0, 4, 'milagro-reposado', 1, 0, 'Tequila Milagro reposado | LaLicorera.com', 'Tequila artesanal, licores a domicilio, licores para eventos, tequila a domicilio', 'tequilas milagro reposado'),
(86, 'Marlboro Ice', 'media caja', '<p>Marlboro Ice, se caracteriza por la frescura que brinda su filtro. LaLicorera.com recuerda que el cigarrillo es perjudicial para la salud y su venta estÃ¡ prohibidad a menores de edad.</p>', 'Marlboro Ice, para aquellos que les gusta lo tradicional con bastante frescura.', 18, 4300, 1, 24, 'marlboro-ice', 6, 0, 'Marlboro Ice | LaLicorera.com', 'venta y compra de marlboro ice en bogota', 'marlboro marlvoro ice ais cigarrillos cigarros sigarrillos frescos frescuras'),
(85, 'Marlboro Rojo', 'media caja', '<p>Cigarrillo Marlboro Rojo. LaLicorera.com recuerda que el consumo de cigarrillos es perjudicial para la salud y su venta estÃ¡ prohibida a menores de edad.</p>', 'Cigarrillo Marlboro Rojo, para aquellos que gustan de lo tradicional.', 18, 4300, 1, 143, 'marlboro-rojo', 4, 0, 'Marlboro Rojo | LaLicorera.com', 'compra de cigarrilos marlboo rojo en bogota', 'marlboro malboro marlvoro marvoro marboro malvoro cigarrillos cigarros puchos fumar'),
(84, 'Coca-Cola', '600 ml', '<p>Coca-Cola-600ml en LaLicorea.com, una presentaciÃ³n personal de una de las bebidas mÃ¡s famosas del mundo.</p>', 'Coca-Cola-600ml en LaLicorea.com, una bebida para disfrutar en toda ocasiÃ³n.', 11, 3000, 0, 9, 'coca-cola-600ml', 5, 0, 'Coca-Cola-600ml en LaLicorea.com', 'Coca-Cola-600ml en LaLicorea.com', 'coca cola cocacola 600 mililitros ml coca-cola'),
(80, 'Glenfiddich 15 aÃ±os 750 ml', '+ Mini 18 aÃ±os', '<p>Glenffidich 15 aÃ±os, whisky del tipo single malt, es almacenado en barricas de roble donde la malta adquiere sus propiedades inigualables y lo hace uno de los mejores de su clase.</p>', 'Glenffidich 15 aÃ±os, uno de los mejores de su clase, almacenado en barricas de roble donde la malta adquiere sus propiedades inigualables.', 10, 196300, 1, 7, 'glenfiddich-15-anos', 27, 0, 'glenfiddich 15 aÃ±os | LaLicorera.com', 'whisky glenfiddich 15 aÃ±os, licor a domicilio en BogotÃ¡', 'glenfiddich 15 aÃ±os whiskey whisky wiskey wisky whyskey whysky wisqui uisqui uiski whiskhey wiskhey wiskhi wiskhy wyskey glenfiddich glenfidich glenfiddish glenfidish glenffiddich glenffidich glenffidish glenffidich 15 quince aÃ±os anos'),
(94, 'Johnnie Walker Blue Label ', '750 ml ', '<p>Johnnie Walker Blue Label, fue lanzado al mercado en 1992, reconocido por la composiciÃ³n de maltas cuyo aÃ±ejamiento sobrepasa en algunos casos los 60 aÃ±os de aÃ±ejamiento.</p>\r\n<p>La parte de abajo en forma de cuadrado de la botella es inspirada en la botella original de Johnnie Walker. De igual forma el cordon que lleva en el pico de la botella, el cual tiene la fecha de 1820 conmemora la fecha en la que la destileria fue creada.</p>', 'Johnnie Walker Blue Label, conocido como &quot;el whisky para conocedores&quot;, es uno de los productos premium de la casa Johnnie Walker, el cual cuenta con whiskies hasta de 60 aÃ±os de aÃ±ejamiento.', 10, 650000, 1, 4, 'johnnie-walker-blue-label', 55, 0, 'Johnnie Walker Blue Label| LaLicorera.com', 'Johnnie Walker Blue Label en bogota, precio Johnnie Walker Blue Labe, licor a domicilio, licores a domiclio bogotÃ¡', 'Scotch whiskey whisky wiskey wisky whyskey whysky wisqui uisqui uiski whiskhey wiskhey wiskhi wiskhy wyskey johnnie johnie jonnie jonie jhonnie jhonie johny johhny johnny jhonhy walker waker woker wolker woquer uoquer blue azul label etiqueta'),
(95, 'Johnnie Walker Double Black', '750 ml', '<p>Johnnie Walker Double Black, lanzado al mercado en Enero del 2010, no tiene una edad determinada, pero su fama se centra en el sabor ahumado que se logra de la mezcla de los whiskies escoceses que lo componen.Â </p>\r\n<p>Johnnie Walker Double Black, es creado a partir deÂ Johnnie Walker Black Label, pero con una adiciÃ³n de sabores mas intensos, ricos en caracteristicas de maduraciÃ³n y ahumados. Un whisky que dejara en tu paladar un sabor profundo.</p>', 'Johnnie Walker Double Black, se dice que su elaboraciÃ³n la componen whiskies de la Costa Este de Escocia, con el fin de obtener su sabor ahumado y reconocido alrededor del mundo.', 10, 124000, 1, 2, 'johnnie-walker-double-black', 59, 0, 'Johnnie Walker Double Black | LaLicorera.com', 'Johnnie Walker Double Black en bogota, Johnnie Walker Double Black precio, licores a domicilio, licor a domicilio en BogotÃ¡', 'Scotch whiskey whisky wiskey wisky whyskey whysky wisqui uisqui uiski whiskhey wiskhey wiskhi wiskhy wyskey johnnie johnie jonnie jonie jhonnie jhonie johny johhny johnny jhonhy walker waker woker wolker woquer uoquer doble double duble black blak negro negra escocia');
