(157, 'Hijos de Villa Rifle', '1.5 Litros', '<p>Tequila Hijos de Villa Rifle, con un soporte de madera premium, esta botella de 1.5 litros de tequila reposado, descresta y se lleva todas las miradas este donde este.</p>', 'Tequila Hijos de Villa Rifle, o tambiÃ©n conocido como Escopeta de Tequila, Ãºnico en su genero, con una base de madera sÃºper luxury.', 7, 899000, 1, 0, 'hijos-de-villa-rifle', 9, 0, 'Hijos De Villa Rifle', 'Tequila, Hijos de Villa, Tequila Escopeta, Escopeta de tequila, Bogota, Colombia, Hijos de Villa Rifle', 'tequilas hijos de villas billas rifles escopetas de'),
(158, 'Sheridans Licor de CafÃ©', '1000 ml', '<p>Sheridans licor de cafe, sirvelo de la manera correcta y crea el famoso coctel <a title=\"Coctel-Cafe-Irlandes\" href=\"http://www.lalicorera.com/cocteles/cafeirlandes\" target=\"_self\">Irish Coffe</a>.</p>', 'Sheridans licor de cafÃ© Irlandes, es el Ãºnico licor que consiste en tener 2 botellas juntas. ', 4, 140000, 1, 0, 'sheridans-licor-de-cafe', 16, 0, 'Sheridans Licor de Cafe', 'Licor de cafÃ©, bogota. Colombia, licor con 2 botellas pegadas, licor blanco y negro, licor blanco y cafe, licor sheridans', 'licor de cafÃ© coffee cofee irish sheridans cheridans sheridance sheredans'),
(159, 'Grand Marnier', '700 ml', '<p>Grand Marnier Cognac, un licor que se puede acompaÃ±ar solo con hielo (en las rocas), o puede ser el ingrediente ideal para crear <a title=\"Cocteles-ingrediente-la-licorera\" href=\"http://www.lalicorera.com/cocteles\" target=\"_blank\">cocteles</a> que contengan naranja o que su ingrediente secundario sea triple sec.</p>', 'Grand Marnier Cognac, es un licor creado a base de cognac 51% y naranjas tropicales exÃ³ticas. ', 4, 149000, 1, 11, 'grand-marnier', 17, 0, 'Grand Marnier Licor', 'Licor de Naranja, licor sabor a naranja, Grand Marnier,  Bogota, Colombia, Cognac de naranja, coÃ±ac de naranja,  triple sec licor', 'grandmarnier grande marner maner mairner coÃ±ac conac cognac'),
(160, 'Glenlivet 18 aÃ±os', '750 ml', '<p>Glenlivet 18, un Whisky creado por Colin Scott en 1997, es la combinaciÃ³n perfecta de los mÃ¡s finos whiskies de Escocia, con un mÃ­nimo de 18 aÃ±os de aÃ±ejamiento. Su corazÃ³n son las destilerÃ­as de Longmorn y Strathisla.</p>\r\n<p style=\"color: #000000; font-family: Times; font-size: medium;\">Â </p>\r\n<p>Sus exclusivas barricas y su maduraciÃ³n lo hacen uno de los whiskies mÃ¡s exquisitos del mundo.</p>\r\n<p style=\"color: #000000; font-family: Times; font-size: medium;\">Â </p>\r\n<p>Se caracteriza por su aroma a madera de roble europeo, nueces secas, chocolate negro, toffee, frutos deshidratados y caramelo. En boca es suave, de buen cuerpo y aterciopelado. De final largo y cÃ¡lido.</p>', 'Whisky Glenlivet 18 aÃ±os, ganador en el 2007 como mejor whisky escocÃ©s blended por la revista Malt Advocate de U.S.', 10, 329900, 1, 2, 'glenlivet-18-anios', 30, 0, 'Whisky Glenlivet 18 aÃ±os', 'Whisky Glenlivet 18 aÃ±os, Whisky Single Malt, Whisky Escoces, Whisky bueno, BogotÃ¡, Colombia', 'glenlivet glenlibet whiskey whisky wiskey wisky whyskey whysky wisqui uisqui uiski whiskhey wiskhey wiskhi wiskhy wyskey 18 aÃ±os anos nuevosprecios'),
(161, 'Jameson Whiskey ', '750 ml Kit de Regalo 2 BBC Lager', '<p>Jameson Whiskey es una mezcla de whiskys de alambique y de grano fino que es tan versÃ¡til como suave. Es un perfecto equilibrio de notas especiadas, de nuez y vainilla con toques de jerez dulce y la suavidad excepcional. El whisky irlandÃ©s mÃ¡s famoso del mundo. 3 veces Destilado.</p>', 'Jameson Whiskey es una mezcla de whiskys de alambique y de grano fino que es tan versÃ¡til como suave. ', 10, 75900, 1, 41, 'jameson-whiskey', 3, 0, 'Jameson Whiskey Bogota', 'Jameson. Whisky, Whiskey, Whiskey Irlandes, Bogota, Colombia', 'whiskey whisky wiskey wisky whyskey whysky wisqui uisqui uiski whiskhey wiskhey wiskhi wiskhy wyskey irlandÃ©s jameson jamesson jammeson jammesson jaimeson jeymeson yameson amoryamistad'),
(162, 'Absolut Ruby Red', '700 ml', '<p>Vodka Ruby Red, con su diseÃ±o peculiar de colores naranja, hace alusion a los sabores tropicales acidos, donde se resalta en el paladar notas a toronja y algo de naranja.</p>', 'Vodka Ruby Red, una ediciÃ³n especial de Absolut en homenaje a los sabores tropicales Ã¡cidos, con sabor a Toronja.', 9, 74000, 1, 3, 'absolut-ruby-red', 10, 0, 'Absolut Ruby Red ', 'Absolut Naranja, Absolut Tropical, Absolut Toronja, Absolut Ruby Red, Vodka Absolut, Vodka Colombia, Bogota, Vodka a Domicilio', 'vodka bodka vodca bodca ruby rubi ruvi ruvi red rojo roja absolut asolut avsolut');
