(186, 'Reyka', '750 ml', '<p>Vodka Reyka premium, producido en Islandia, un vodka artesanal, donde se involucran alambiques de cobre unicos en el mundo para su elaboraciÃ³n; al igual que un proceso de filtraciÃ³n mediante rocas volcÃ¡nicas.Â </p>', 'Vodka Reyka, ultra premium, producido en Islandia, filtrado mediante roca volcÃ¡nica. ', 9, 109900, 1, 6, 'reyka', 13, 0, 'Vodka Reyka Premium', 'Vodka Ultra Premium, Vodka Reyka, Vodka en BogotÃ¡, Colombia', 'vodka bodka vodca bodca reyka reika reyca reica ultra premium'),
(173, 'Corinto Cabernet Sauvignon 2013', '750 ml + 2 x 187ml', '<p>Vino Corinto Cabernet Sauvignon 2013, de intenso color purpura, excelente estructura. Propociona aromas a frutos rojos, esepcialmente ciruela y cereza. AcompaÃ±elo con carnes rojas como cerdo, cordero o res.</p>', 'Vino Corinto Cabernet Sauvignon 2013, frutoso, juvenil, ideal para cualquier ocasiÃ³n.', 8, 28000, 0, 18, 'corinto-cabernet-sauvignon-2013', 1, 0, 'Vino Tinto Corinto Cabernet Sauvignon', 'Vino Chileno, Vino del Valle Central de Chile, Bogota, Colombia, Vino Corinto Cabernet Sauvignon', 'vinos tintos cabernet cavernet caberned caberned sauvignon savignon suvignon sevignon sauviÃ±on saviÃ±on suviÃ±on seviÃ±on corinto 2013 chileno'),
(174, 'Santa Rosa Syrah Rose', '750 ml', '<p>Vino rosado Santa Rosa Syrah, con aroma a frutas frescas como cereza y frambuesa, con final muy expresivo, frutal, delicado y muy refrescante.</p>', 'Vino Santa Rosa Syrah Rose + vino espumoso Extra Brut Santa Julia, un vino rosado frutal y refrescante. ', 8, 32000, 0, 9, 'santa-rosa-syrah-rose', 3, 0, 'Vino Santa Rosa Syrah Rose', 'Vino Santa Rosa Rose, Bogota, Colombia, Vino Rosado Argentino, Vino frutoso rosado', 'vinos rosados rose syrah sirah sirha syrha espumoso santa rosa'),
