(176, 'Corinto Sauvignon Blanc', '750ml', '<p>Vino Corinto Sauvignon Blanc, este vino fÃ¡cil de beber, proporciona un sabor en boca atractivamente chispeante, cÃ­trico y sabores a toronja acompaÃ±an un final vibrante.</p>', 'Vino Corinto Sauvignon Blanc, de intensos aromas a frutas cÃ­tricas y blancas, con notas herbÃ¡ceas.', 8, 26000, 0, 6, 'corinto-sauvignon-blanc', 4, 0, 'Vino Corinto Sauvignon Blanc', 'Vino Blanco Chileno, Vino Sauvignon Blanc, Bogota, Colombia, Vino Frutoso Blanco', 'vinos blancos sauvignon savignon suvignon sevignon sauviÃ±on saviÃ±on suviÃ±on seviÃ±on chileno'),
(177, 'Santa Rosa Chardonnay', '750ml', '<p>Vino Santa Rosa Chardonnay, ideal para acompaÃ±ar ensaladas, pollo grillado y mariscos. Este Chardonnay presenta caracterÃ­sticos aromas a frutas tropicales y naranja.</p>', 'Vino Santa Rosa Chardonnay, con aromas a frutas tropicales y naranja; mÃ¡s la complejidad de los cÃ­tricos.', 8, 34000, 0, 4, 'santa-rosa-chardonnay', 5, 0, 'Vino Santa Rosa Chardonnay', 'Vino semiseco argentino, Bogota, Colombia, Vino Chardonnay Argentino, Mejor Vino Argentino', 'vinos blancos chardonnay chardonney chardonay chardoney shardonnay shardonney shardonay shardoney chardonnai chardonnei chardonai chardonei santa rosa'),
