(182, 'Chivas Revolve', '750 ml', '<p>Chivas Revolve, comienza la revoluciÃ³n siendo el whisly mas suave del mundo, triplemente destilado, es una mezcla de whiskys de 12, 18 y 25 aÃ±os de aÃ±ejamiento.</p>', 'Chivas Revolve, el whisky mas suave del mundo. Triplemente destilado', 10, 490000, 1, 0, 'chivas-revolve', 51, 0, 'Chivas Revolve', 'Chivas Revolve, Bogota, Colombia, Edicion Limitada de Chivas, Lo mejor de Chivas', 'whiskey whisky wiskey wisky whyskey whysky wisqui uisqui uiski whiskhey wiskhey wiskhi wiskhy wyskey chivas chibas revolve rebolbe revolbe rebolve suave'),
(179, 'Sake Sho Chiku Bai', '750 ml', '<p>Sake Tradicional Sho Chiku Bai, este licor elaborado a partir de la destilaciÃ³n tradicional del arroz, es suave y bien balanceado al paladar. Servir frio.</p>\r\n<p>Â </p>', 'Sake Tradicional Sho Chiku Bai, destilado naturalmente, bebida tradicional de Japon.', 4, 50000, 1, 0, 'sake-sho-chiku-bai', 19, 0, 'Sake Sho Chiku Bai Bogota', 'Sake, Licor de Japon, Bogota, Colombia, Sake Sho Chiku Bai, Comprar Sake en Bogota', 'sake saque japonÃ©s sho chiky shiky chicu shicu bai bay'),
(180, 'Beefeater 24', '750 ml', '<p>SÃºper Premium London Dry Gin, que cuenta con 12 ingredientes naturales que proceden de distintos paÃ­ses de todo el mundo, entre los que se encuentran Te Sencha JaponÃ©s, Te verde Chino, CÃ¡scara de toronja, entre otros.</p>\r\n<p style=\"color: #000000; font-family: Times; font-size: medium;\">Â </p>\r\n<p>Estos ingredientes botÃ¡nicos reposan en el alcohol mÃ¡s fino durante 24 horas. Durante las siguientes siete horas de destilaciÃ³n, se selecciona Ãºnicamente la parte central de la misma, tambiÃ©n llamada CorazÃ³n de la destilaciÃ³n. Al tener tÃ© dentro de su elaboraciÃ³n hay que hacer el â€œcorteâ€ del alcohol antes para que no quede muy astringente, por eso es mÃ¡s costosa, porque se desperdicia 35% mÃ¡s de alcohol.</p>\r\n<p style=\"color: #000000; font-family: Times; font-size: medium;\">Â </p>\r\n<p>Este es un proceso Ãºnico para Beefeater que ayuda a crear una ginebra de lujo con una complejidad y suavidad incomparable.</p>\r\n<p style=\"color: #000000; font-family: Times; font-size: medium;\">Â </p>\r\n<p>Beefeater 24 se embotella a 45% alc por volÃºmen, un sabor suave y persistente, muy elegante.</p>', 'Beefeater 24, la unica ginebra cuyos botÃ¡nicos son  infundidos durante 24 horas, antes de comenzar la destilaciÃ³n. ', 5, 139900, 1, 4, 'beereater-24', 5, 0, 'Beefeater 24 Bogota', 'Beefeater 24, La Mejor Ginebra, Bogota, Colombia, Ginebra Ingles, Ginebra Londinense', 'beefeater bifeater beafeater bifiter ginebra jinebra nuevosprecios amoryamistad'),
