(220, 'Pravda Vodka', '750 ml', '<p>Pravda Vodka.Â El agua que se obtiene para producir el vodka pravda proviene de los manantiales naturales de las aguas mÃ¡s puras y cristalinas de las montaÃ±as de CÃ¡rpatos.</p>\r\n<p>Pravda logra resistir al pasar de los aÃ±os, con tributo a la pasiÃ³n y a la artesanÃ­a que esta botella consagra en la producciÃ³n de una joya de los vodkas</p>', 'Pravda, vodka cuya nobleza data desde el aÃ±o 1743, el vodka Pravda fue reservado por la nobleza polaca para que fuera usado solo en ocasiones con suprema especialidad. ', 9, 129000, 1, 1, 'pravda-vodka', 2, 0, 'Vodka Pravda Colombia', 'Vodka Pravda, Vodka Premium Colombia, Bogota, Vodka Polaco', 'vodka bodka vodca bodca pravda prabda prada'),
