(225, 'Chartreause June Amarillo', '750 ml', '<p>Chartreause June Amarillo, es un licor frances, hechoÂ con las mÃ¡s selectas hierbas maceradas. Lleva este nombre en homenaje al monasterio cartujo del gran chartreuse, desde donde proviene.</p>', 'Chartreause June Amarillo, licor frances, elaborado con hasta 130 hierbas, miel y envejecido en barricas de roble frances.', 4, 179000, 1, 2, 'chartreause-june-amarillo', 1, 0, 'Licor Chartreause June Amariilo', 'Licor Chartreause Amarillo, Licor Amarillo, Licor Amarillo Frances, Bogota, Colombia', 'chartreause chartreuse chertrese chertreuse june amarillo amarilo'),
