(242, 'Pisco ViÃ±as de Oro Quebranta', '750 ml', '<p>Pisco VinÃ±as de Oro, del tipo quebranta, el pisco es un derivado del jugo de uvas, cuyo proceso de destilaciÃ³n y reposo de por lo menos 10 meses en tamques de acero, se realiza en lugares especÃ­ficos de PerÃº.Â </p>', 'Pisco ViÃ±as de Oro, un pisco del tipo quebranta; en cuyo proceso de destilaciÃ³n se mezclan distintas clases de piscos como aromÃ¡ticos y no aromÃ¡ticos.', 4, 129900, 1, 4, 'pisco-vinas-de-oro-quebranta', 5, 0, 'Pisco ViÃ±as de Oro Quebranta', 'Pisco Acholado, Pisco Quebranta, Pisco ViÃ±as de Oro., Pisco Peruano', 'pisco viÃ±as de oro pizco pisko pizko'),
(243, 'Sake G Momokawa', '750 ml', '<p>Sake G Momokawa,Â muy aromÃ¡tico, con notas a fresas que pasan a sabores densos de pera, melocotÃ³n y el melÃ³n.</p>', 'Sake G Momokawa, licor premium japonÃ©ss, con notas pera, melon y melocoton. Elaborado para paladares refinados.', 4, 139900, 1, 1, 'sake-g-momokawa-premium', 9, 0, 'Sake G Momokawa Premium', 'Sake Premium, Sake Ultra Premium, Sake Momokawa, Bogota, Colombia', 'sake saque japonÃ©s'),
