(245, 'Ron Maestro Gabo', '750 ml', '<p>Ron Maestro Gabo,Â dentro de sus caracterÃ­sticas esta su peculiar color caoba brillante, hecho con mucha pasiÃ³n, un exquisito sabor y un notable olor que se equilibran con sus dulces notas de fruta y vainilla y sensaciones de los frutos secos, especias y tabaco; haciendo de este un ron Premium.</p>', 'Ron Maestro Gabo, un tributo a Gabriel Garcia MÃ¡rquez, este ron es un resultado de la magia caribeÃ±a', 6, 119900, 1, 8, 'maestro-gabo', 3, 0, 'Ron Maestro Gabo', 'Ron Gabo, Ron Maestro Gabo. Ron Gabriel Garcia Marquez, Ron Colombiano, Bogota, Colombia', 'rones maestro gabo gabriel garcia garsia marquez marques magia caribe caribeÃ±o caribeÃ±a'),
