(247, 'Kahlua Licor de CafÃ©', '750 ml', '<p>Kahlua, licor de cafÃ©, es una mezcla de 100% cafÃ© arÃ¡biga y destilado de caÃ±a, los cuales crean una intensidad oscura con un rico sabor con notas de vainilla y caramelo. Disfrutalo frio, con hielo o con tu cocktail favorito o bebiendo con cafÃ©.</p>', 'Kahlua licor de cafÃ©, producido en las altas montaÃ±as de Veracruz, MÃ©xico. Mezcla de 100% cafÃ© arÃ¡biga y destilado de caÃ±a.', 4, 129900, 1, 0, 'kahlua-licor-de-cafe', 3, 0, 'Kahlua Licor de Cafe', 'Kahlua, Licor de Cafe, Colombia, Bogota', 'calua kahlua kalua cahlua kalhua cafÃ©'),
(250, 'Ron Santafe 12 aÃ±os Nido de CÃ³ndores', '750 ml', '<p>Ron SantaFe 12 aÃ±os Nido de CÃ³ndores, mieles de caÃ±a de primera calidad, finas maderas americanas y un paciente envejecimiento, se mezclan en un proceso Premium de refinamiento y elaboraciÃ³n, lo que nos lleva a un sabor a caramelo y frutos secos, con un alcohol bastante largo y un final elegante.</p>', 'Ron 12 aÃ±os Nido de CÃ³ndores, su nombre de origen â€œKuntur Magaâ€, que traducida de la lengua chibcha traduce â€œNido de CÃ³ndoresâ€.', 6, 99900, 1, 2, 'ron-nido-de-condores', 3, 0, 'Ron SantaFe Nido de CÃ³ndores 12 aÃ±os', 'Ron SantaFe 12 AÃ±os, Ron Nido de Condores, Bogota, Colombia', 'rones 12 doce aÃ±os nido de cÃ³ndores chibcha kuntur maga cuntur maja'),
