(269, 'Bols Blue Curacao', '750 ml', '<p>Este licor se conocÃ­a como - CrÃ¨me de Ciel - en el siglo XIX, que significa - Crema del cielo -. Es creado con una destilaciÃ³n de cÃ¡scara de naranja amarga. Su color es azul y su aroma y sabor es tenue a naranja con notas florales.</p>', 'Este licor se conocÃ­a como - CrÃ¨me de Ciel - en el siglo XIX, que significa - Crema del cielo -.', 4, 62900, 1, 1, 'bols-blue-curacao', 1, 0, 'Bols Blue Curacao 750 ml | LaLicorera.com', 'bols blue, curacao', 'bols vols blue curacao curazao curaÃ§ao'),
(270, 'Soho Lychee Liquor', '750 ml', '<p>Es un licor con esencia natural de la fruta asiÃ¡tica lichi, proveniente del sur de China. Es claro como el cristal y su aroma es acre y frutal. Su sabor ademÃ¡s de frutal, tiene tonos de pÃ©talos de rosas. El grado alcohÃ³lico es 21%.</p>', 'Es un licor con esencia natural de la fruta asiÃ¡tica lichi, proveniente del sur de China. Es claro como el cristal y su aroma es acre y frutal.', 4, 84900, 1, 4, 'soho-lychee-liquor', 1, 0, 'Soho Lychee Liquor 750 ml | LaLicorera.com', 'soho, lychee', 'soho liche lychee lychi lichi lyche liquor licor'),
(271, 'Bacardi Daiquiri', '750 ml', '<p>Este ron es una presentaciÃ³n del clÃ¡sico coctel DaiquirÃ­, que se dice fue inventando en Cuba, que tiene una playa y una mina de hierro llamadas DaiquirÃ­. Este clÃ¡sico coctel viene listo en esta presentaciÃ³n con sabores dulces a fresas, limÃ³n y ron superior.</p>', 'Este ron es una presentaciÃ³n del clÃ¡sico coctel DaiquirÃ­, que se dice fue inventando en Cuba, que tiene una playa y una mina de hierro llamadas DaiquirÃ­.', 6, 49900, 1, 3, 'bacardi-daiquiri', 7, 0, 'Bacardi Daiquiri 750 ml | LaLicorera.com', 'bacardi, daiquirÃ­', 'bacardÃ­ vacardi daiquiri daikiri 750 mililitros ml'),
(272, 'Bacardi PiÃ±a Colada', '750 ml', '<p>Este ron es una presentaciÃ³n del famoso coctel PiÃ±a Colada. Su dulce sabor se combina con el agua de coco y la piÃ±a. SÃ³lo serÃ¡ necesario agregar hielo y estÃ¡ listo para consumir.</p>', 'Este ron es una presentaciÃ³n del famoso coctel PiÃ±a Colada. Su dulce sabor se combina con el agua de coco y la piÃ±a. SÃ³lo serÃ¡ necesario agregar hielo y estÃ¡ listo para consumir.', 6, 49900, 1, 2, 'bacardi-pina-colada', 7, 0, 'Bacardi PiÃ±a Colada 750 ml | LaLicorera.com', 'bacardi, ron, piÃ±a colada', 'bacardÃ­ vacardi piÃ±a colada pina 750 mililitros ml'),
(273, 'Macallan 12 aÃ±os ', '700 ml', '<p><a title=\"Whisky Macallan 12 aÃ±os Triple Cask\" href=\"https://www.lalicorera.com/blog/whisky-macallan-en-bogota-y-colombia\" target=\"_self\">Whisky Macallan 12 aÃ±os</a>. Whisky escocÃ©s de color oro puro. Su aroma es a vainilla con tonos de jengibre. Su sabor es suave, con frutos secos y jerez, en equilibrio con sus tonos madera y especias. Un sabor inigualble. Sin conservantes ni colorantes.</p>', 'Whisky Macallan 12 aÃ±os. Su color es oro puro. Su aroma es a vainilla con tonos de jengibre. Su sabor es suave, con frutos secos y jerez, en equilibrio con sus tonos madera y especias.', 10, 173500, 1, 45, 'macallan-12-anos', 18, 0, 'Macallan 12 aÃ±os 750 ml | LaLicorera.com', 'Whisky, Macallan, 12 aÃ±os, Triple Cask, El Mejor Whisky Del Mundo, Whisky The Macallan, Whisky Macallan 12 aÃ±os, Bogota, Colombia', 'whiskey whisky wiskey wisky whyskey whysky wisqui uisqui uiski whiskhey wiskhey wiskhi wiskhy wyskey macallan macalan makallan makalan 12 doce aÃ±os anos mcallan mc malan mac alan'),
(274, 'Glenlivet 15 aÃ±os', '750 ml', '<p>Glenlivet 15 aÃ±os, single malt, este whisky escocÃ©s ha sido madurado en barricas francesas de roble en Limousin. Tiene notas de madera resinosa con una acidez bien equilibrada. Su sabor es completo con especias de invierno, canela y clavo de olor. El final es largo y seco, con una nota picante.</p>', 'Este whisky escocÃ©s ha sido madurado en barricas francesas de roble en Limousin. Tiene notas de madera resinosa con una acidez bien equilibrada. Su sabor es completo con especias de invierno, canela y clavo de olor. El final es largo y seco, con una nota picante.', 10, 182000, 1, 2, 'glenlivet-15-anos', 31, 0, 'Glenlivet 15 aÃ±os 750 ml | LaLicorera.com', 'glenlivet, 15 aÃ±os', 'whiskey whisky wiskey wisky whyskey whysky wisqui uisqui uiski whiskhey wiskhey wiskhi wiskhy wyskey glenlivet glenlibet quince 15 aÃ±os anos nuevosprecios');
