(275, 'Glenlivet Founders Reserve', '750 ml', '<p>The Glenlivet Founder Reserve, es el whisky de malta mÃ¡s reconocido a nivel mundial por su calidad y tradiciÃ³n y la segunda malta mÃ¡s vendida en el mundo entero. En algÃºn momento fue la malta con la que se compararon el resto.</p>\r\n<p>AÃ±ejado en barricas seleccioandas de roble americano.</p>\r\n<p>Su proceso de fabricaciÃ³n y maduraciÃ³n se conserva inalterable desde su creaciÃ³n por George Smith en 1824. Su nombre fue tratdo de copiar por muchos productores debido a su calidad y reputaciÃ³n, pero es el Ãºnico que puede llamarse The Glenlivet.</p>\r\n<p>40% de alcohol.</p>\r\n<p>Ligero, suave, delicado, floral y frutal (peras y almibar de frutas en conserva), muy elegante y aterciopelado</p>', 'The Glenlivet Founders Reserve, es el whisky de malta mÃ¡s reconocido a nivel mundial por su calidad y tradiciÃ³n.', 10, 132900, 1, 12, 'glenlivet-founders-reserve', 31, 0, 'Glenlivet Founders Reserve 750 ml | LaLicorera.com', 'glenlivet, founders', 'whiskey whisky wiskey wisky whyskey whysky wisqui uisqui uiski whiskhey wiskhey wiskhi wiskhy wyskey escocÃ©s glenlivet glenlibet founders funders fonders reserve reserva'),
