(278, 'Cerveza Corona Extra Six Pack', '710ml', '<p>VersiÃ³n Six Pack - seis botellas de 710ml - de Cerveza Corona Extra. Esta cerveza de origen mexicano, es mundialmente conocida ya que se distribuye en mÃ¡s de 170 paÃ­ses. Se elabora desde 1925. Es la cerveza mÃ¡s vendida en MÃ©xico y la mÃ¡s importada en Estados Unidos.</p>', 'VersiÃ³n Six Pack de cerveza Corona Extra. Cada botella de 710ml.', 3, 45000, 0, 22, 'corona-extra-six-pack-710ml', 11, 0, 'Cerveza Corona Extra Six Pack 710ml | LaLicorera.com', 'cerveza, corona, extra, six pack, 710', 'cervezas polas chelas birras virras frÃ­as six pack pak sics cics cix botellas corona extra 710 mililitros ml seis 6'),
(279, 'Old Parr Tribute', '750 ml', '<p>El whiskey Old Parr Tribute fue inspirado en Colombia como agradecimiento por ser los mayores consumidores de esta bebida. Los mezcladores escoceses encargados de crear el tributo dicen haber tenido en cuenta la idea de celebrar, de fiesta y de disfrutar. Es un whisky fÃ¡cil de beber, con sensaciÃ³n de cremosidad, que se puede beber solo, con hielo o mezclarlo con otras bebidas.</p>', 'El whiskey Old Parr Tribute fue inspirado en Colombia como agradecimiento por ser los mayores consumidores de esta bebida.', 10, 125000, 1, 0, 'old-parr-tribute', 65, 0, 'Old Parr Tribute | La Licorera', 'old parr tribute', 'Scotch olpar oldpar oldparr whiskey whisky wiski tribute wisky wyski wiskey whyskei whiskey whisky wiskey wisky whyskey whysky wisqui uisqui uiski whiskhey wiskhey wiskhi wiskhy wyskey'),
(280, 'Ricard', '700ml', '<p>Ricard es un licor francÃ©s, resultado de la prohibiciÃ³n del <a href=\"https://www.lalicorera.com/blog/absenta-absinthe-bogota\" target=\"_blank\">absenta</a> en Francia, reformulando la receta con anÃ­s y disminuyendo su nivel de alcohol porcentual al permitido. Es un aperitivo refrescante que mantiene su misma receta desde 1932.</p>', 'Ricard es un licor francÃ©s, resultado de la prohibiciÃ³n del absenta en Francia, reformulando la receta con anÃ­s y disminuyendo su nivel de alcohol porcentual al permitido.', 4, 80000, 1, 3, 'ricard', 10, 0, 'Ricard | La Licorera', 'ricard', 'ricard absenta anis'),
(281, 'AntioqueÃ±o Azul', '750 ml', '<p>Aguardiente AntioqueÃ±o Azul en presentaciÃ³n de 750ml, un aguardiente sin azÃºcar que no puede faltar para celebrar cualquier ocasiÃ³n especial, elaborado con alcoholes puros, que mezclado y unido a esencias naturales de anÃ­s logra su sabor caracterÃ­stico, con un aroma suave y placentero que refleja el carÃ¡cter de la regiÃ³n en donde es elaborado (AntioquÃ­a).</p>', 'Aguardiente AntioqueÃ±o Azul en presentaciÃ³n de 750ml, un aguardiente sin azÃºcar que no puede faltar para celebrar cualquier ocasiÃ³n especial.', 1, 39900, 1, 4, 'antioqueno-azul-750', 3, 0, 'AntioqueÃ±o Azul | La Licorera', 'antioqueÃ±o, azul', 'antioqueÃ±o antioqueno azul aguardiente guaro 750 mililitros ml sin no azÃºcar'),
(282, 'Absolut Vanilia', '700 ml', '<p>El Absolut Vanilia fue lanzado en 2003 debido a que el sabor de vainilla es uno de los mÃ¡s apetecidos en el mundo entero. Es un vodka sin azÃºcares aÃ±adidos con sabores ricos, robustos y complejos. Con sabor a vainilla, notas de caramelo de azÃºcar con mantequilla y toques de chocolate.</p>', 'El Absolut Vanilia fue lanzado en 2003 debido a que el sabor de vainilla es uno de los mÃ¡s apetecidos en el mundo entero. ', 9, 74000, 1, 3, 'absolut-vanilia', 2, 0, 'Absolut Vanilia', 'absolut vanilia', 'absolut asolut avsolut vainilla vainilia 750 mililitros ml vodka bodka vodca bodca vanilla vainiya banilla bainilla diamujer'),
(283, 'Absolut Peppar', '700 ml', '<p>El Absolut Peppar fue el primer vodka con sabor aÃ±adido en el mundo entero. NaciÃ³ basado en la idea del <a href=\"https://www.lalicorera.com/cocteles/bloody-mary\" target=\"_self\">coctel Bloody Mary</a> que tiene como ingredientes pimienta y vodka, logrando asÃ­ un licor que facilita el trabajo en los bares. No contiene azÃºcar aÃ±adido, es picante y especiado con un carÃ¡cter distintivo.</p>', 'El Absolut Peppar fue el primer vodka con sabor aÃ±adido en el mundo entero. NaciÃ³ basado en la idea del coctel Bloody Mary.', 9, 74000, 1, 1, 'absolut-peppar', 2, 0, 'Absolut Peppar | La Licorera', 'absolut, pepper, peppar, vodka', 'vodka bodka vodca bodca absolut asolut avsolut pepper peper peppar pepar pimienta bloody blody mery mary meri mari bloodi blodi'),
(284, 'Absolut Vodka', '700 ml LOVE Edition', '<p>El Absolut Vodka, es aÃºn producido en un pequeÃ±o pueblo de Suecia llamado Ahus, y como dato curioso; el diseÃ±o de su botella proviene de un modelo antiguo de botellas medicinales utilizadas en Suecia en los siglos 16 y 17.</p>\r\n<p>En la actualidad, es uno de los vodkas mÃ¡s vendidos a nivel mundial y reconocido por su estilo minimalista; suele venderse en presentaciones limitadas.</p>', 'El Absolut Vodka, es aÃºn producido en un pequeÃ±o pueblo de Suecia llamado Ahus, y como dato curioso; el diseÃ±o de su botella proviene de un modelo antiguo de botellas medicinales utilizadas en Suecia en los siglos 16 y 17.', 9, 62900, 1, 24, 'absolut-promo', 1, 0, 'Absolut Vodka | La Licorera', 'absolut, vodka, litro, Bogota, Colombia', 'absolut asolut avsolut vodka bodka vodca bodca1 litro absoluto combo_halloween'),
(285, 'Frontera Chardonnay', '750 ml', '<p>Frontera Chardonnay es un vino blanco con carÃ¡cter frutal, notas manzana y frutas tropicales, refrescante y balanceado.</p>', 'Frontera Chardonnay es un vino blanco con carÃ¡cter frutal, notas manzana y frutas tropicales, refrescante y balanceado.', 8, 35000, 1, 17, 'frontera-chardonnay', 2, 0, 'Frontera Chardonnay | La Licorera', 'frontera, chardonnay', 'fronteras chardoney chardonay chardonnay vinos blancos chardonnay chardonney chardonay chardoney shardonnay shardonney shardonay shardoney chardonnai chardonnei chardonai chardonei'),
