(318, 'ManÃ­ Especial con ArÃ¡ndanos y mas', '180 mg', '<p>Mezcla de maÃ­ con sal, maÃ­s tostado, manÃ­ confitado, almendras y arÃ¡ndanos.</p>', 'ManÃ­ especial con sal, maÃ­z tostado, manÃ­ confitado, almendras y arÃ¡ndanos.', 19, 9000, 1, 10, 'mani-especial-arandanos', 1, 0, 'Mani Especial Con Arandanos', 'Mani Especial con Arandanos', 'Mani Snacks Arandanos almendras maÃ­z'),
