(287, 'Balvenie 14 aÃ±os Caribbean Cask', '750 ml', '<p>Whisky Balvenie 14 aÃ±os, un whisky artesanal Escoces, del tipo single malt artesanal, que proporciona sabores al paladar de toffe, caramelo y vainilla; gracias a su aÃ±ejamiento en barriles de ron caribeÃ±o.</p>', 'Whisky Balvenie 14 aÃ±os, finaliza su maduraciÃ³n en barricas de ron del Caribe.', 10, 269000, 1, 12, 'balvenie-14-caribbean-cask', 22, 0, 'Whisky Balvenie 14 aÃ±os ', 'Whisky. Whisky Balvenie 14 aÃ±os. Whisky con sabor a ron. Whisky aÃ±ejado en barricas de ron', 'Whisky, Balvenie, Whisky sabor a ron, Whisky Artesanal, Balvin, Whisky aÃ±ejo, wisky, whiskey'),
(379, 'Parce 8 aÃ±os', '750 ml', '<p><a title=\"Ron Parce Donde Comprar\" href=\"https://www.lalicorera.com/blog/ron-parce-en-bogota-colombia\" target=\"_self\">Ron Parce 8 aÃ±os</a>, una creaciÃ³n de maestros, aÃ±ejado en barricas de roble americano ex-bourbon. En pocas palabras, cada gota de este ron es una expresiÃ³n elocuente del tiempo de aÃ±ejamiento y cuidado de maestros roneros.</p>', 'Ron Parce 8 aÃ±os, una creaciÃ³n de maestros, aÃ±ejado en barriles de roble americano de bourbon, buscando crear nariz, cuerpo y un sabor Ãºnico. ', 6, 179900, 1, 2, 'parce-8-anios', 2, 0, 'Ron Parce 8 AÃ±os en Colombia - A Domicilio', 'Ron, Ron Parce, Ron Parce 8 aÃ±os, Colombia, Bogota, El Mejor Ron Del Mundo, Donde Conseguir Ron Parce', 'Ron Parce Parse Pare Rum '),
