(324, 'Marques de Riscal Rueda', '750 ml', '<p>Vino blanco MarquÃ©s de Riscal Reuda, del tipo de DenominaciÃ³n de Origen Rueda. ElÃ¡borado a partir de la uva autÃ³ctona Verdejo, con agradables notas florales y de hierbas tÃ­picas de la variedad; tiene una sensaciÃ³n untuosa y fresca en boca con ligero amargor varietal final.Â </p>', 'Vino Blanco MarquÃ©s de Riscal Rueda, con agradables notas florales.', 8, 52000, 1, 4, 'marques-de-riscal-rueda', 18, 0, 'MarquÃ©s de Riscal Rueda', 'Vino Blanco EspaÃ±ol, Vino Marques de Riscal Rueda, Bogota, Colombia', 'Vino Blanco Marques Marquez Riscal Rueda '),
