(345, 'Gin Mare 750 ml +', '4 Tonicas 1724', '<p>Gin Mare Pack NavideÃ±o, para los amantes del Gin&amp;Tonic.</p>', 'Gin Mare Pack NavideÃ±o, para los amantes del Gin &amp; Tonic', 24, 159900, 0, 0, 'gin-mare-pack', 4, 0, 'Gin Mare Pack', 'Colombia, Bogota, Gin Mare', 'Gin Mare tonica pack mar'),
(321, 'Old Parr 750 ml', '+ 2 Heineken', '<p>Old Parr se dice que fue creado por el hombre mÃ¡s viejo que haya vivido en el Reino Unido, Thomas Parr quien a sus 153 aÃ±os, conocido como el Gran Old Parr. Whisky premium que se obtiene de las maltas de Rangganmore y Glendullan.Â </p>', 'Whisky Old Parr 12 aÃ±os + 2 Coronas 355ml, perfecta combinaciÃ³n para un buen momento', 24, 99900, 0, 14, 'oldparr-heineken', 1, 0, 'Whisky Old Parr 12 aÃ±os + Heineken', 'Whisky, Old Parr, ManÃ­, Especial, ArÃ¡ndanos, PromociÃ³n, BogotÃ¡, Colombia, Domicilios', 'Whisky, wiskey, wisky, whisky, old parr, olpar, guajiro, trago, licor, allpar, BogotÃ¡, Colombia, Domicilios'),
(322, 'Cerveza Redds', '263 ml', '<p>Cervez Redds, conocida como la cerveza para las mujeres, pero es una bebida que se acomoda a cualquier ocasiÃ³n puesto que se puede tomar frÃ­a, con hielo o en coctel.Â </p>', 'Cerveza Redds de 263 ml, la bebida que se amolda a la ocasiÃ³n', 3, 2600, 1, 13, 'cerveza-redds', 20, 0, 'Cerveza Redds 263 ml', 'Cerveza, para ,mujer, cerveza, verde, redds', 'redds, reds, rets, cerveza, mujer, lareds'),
