(329, 'John Walker &amp; Sons Private Collection - 2015 Edition -', '700 ml', '<p>John Walker Sons Private Collection, ediciÃ³n de lujo 2015, extremadamente limitada, que es ofrecida al publico en pocas ediciones y lotes. Esta EdiciÃ³n titulada â€œRare Fruit Characterâ€, se centra en los sabores afrutados dentro de la gama Johnnie Walker, con los 29 barriles que componen la mezcla elegida para enfatizar esa parte del clÃ¡sico personaje Walker.</p>', 'John Walker Sons Private Collection, una colecciÃ³n para los directivos de la empresa extremadamente limitada.', 10, 2499000, 1, 1, 'jhon-walker-sons-private-collection-2015', 7, 0, 'Whisky John Walker &amp; Sons Private Collection 2015', 'Whisky, Whiskey. Jhon Walker &amp; Sons Private Collection, Colombia, Bogota', 'Scotch Whisky whiskey Jhon John Wlaker Walker scoth wlaker Private Sons Collection '),
(330, 'Santa Rita Merlot 120', '750 ml', '<p>Vino Merlot Santa Rita 120, es un vino de gran volumen, con un buen blanace entre una adecuada acidez y taninos maduros que e desarrollan en toda la boca, con un final refrescante y frutal.</p>', 'Vino Merlot Santa Rita 120 con intensos aromas frutales que recuerdan frutos rojos. Vino Chileno.', 8, 39900, 1, 12, 'santa-rita-merlot-120', 2, 0, 'Vino Tinto Santa Rita Merlot 120', 'Vino Chileno, Vino Merlot, Vino Santa Rita 120 Merlot, Vino Frutos Rojos', 'Vino tinto rojo frutos rojos santa rita 120 chile chileno'),
