(332, 'Macallan Rare Cask', '700 ml', '<p>Macallan Rare Cask, siguiendo el compromiso de Macallan de crear Maltas unicas y de color natural tiene notas suaves a vainilla y uva pasa en nariz, generando un ensamble de manzana, limÃ³n y naranja. Todo equilibrado por un cuarteto picante de raÃ­z de jengibre, canela, nuez moscada y clavo de olor. En el paladar este cuarteto picante es inquebrantable.</p>\r\n<p>El roble resuena, atemporal, pulido y rico; la vainilla y el chocolate llevan el final junto con un zezt ligero de la fruta cÃ­trica.</p>', 'Macallan Rare Cask, reposado en barriles de Jerez EspaÃ±ol cuidadosamente seleccionados. Su color es natural e intensamente profundo.', 10, 1699000, 1, 3, 'macallan-rare-cask', 14, 0, 'Whisky Macallan Rare Cask', 'Whisky. Whiskey, Macallan Rare Cask, Bogota, Colombia, Macallan Rare Cask', 'Whisky Macallan Macalan Rare Cask Rar Whiskey Single Malt'),
