(431, 'Grappa di Amarone Allegrini', '500 ml', '<p>La familia Allegrini tiene 90 hectÃ¡reas de viÃ±edo en el corazÃ³n del Ã¡rea de Valpolicella Classico.</p>\r\n<p>El envejecimiento en roble realmente suaviza el carÃ¡cter normalmente feroz y agresivo de la grappa clÃ¡sica. Y, por supuesto, al ser de Allegrini, no estarÃ­a en el mercado a menos que fuera excepcional de este tipo.</p>\r\n<p>Gestionados por familias durante muchas generaciones, son el referente de calidad en el Ã¡rea.</p>', 'El Amarone estÃ¡ hecho de 80% de Corvina, 15% de Rondinella, 5% de Oseleta; despuÃ©s de la fermentaciÃ³n, el orujo de esas uvas se fermenta antes de agregar agua destilada para alcanzar un nivel \\\\\\&quot;potable\\\\\\&quot; del 43%; y luego aÃ±ejado en barricas de roble por aÃ±o.', 4, 286500, 1, 1, 'grappa-di-amarone-allegrini', 5, 0, 'Grappa di Amarone Allegrini', 'grappa di amarone, allegrini, bogota, colombia, domicilios, licor', 'grappa, amarone, allegrini, grapa, alegrini, alegrinni, allegrinni, alegri'),
(432, 'The Singleton of Dufftown', '700 ml', '<p style=\"text-align: justify;\">El singleton de Dufftown a menudo se describe como poseedor de una suavidad excepcional, aunque el espÃ­ritu de nueva creaciÃ³n de sus tres pares de imÃ¡genes tiene un carÃ¡cter picante. Usando una combinaciÃ³n de barricas de roble americano y europeo en aproximadamente una divisiÃ³n de 50/50, el acabado redondea ese borde, evocando en algunas expresiones notas de cereal mÃ¡s nuciosas de este Speysider.</p>\r\n<p style=\"text-align: justify;\">El Singleton de Dufftown fue construido durante el reinado de la Reina Victoria. Y aunque los mÃ©todos tradicionales, los siglos de artesanÃ­a y la antigua fuente de agua permanecen, Dufftown, la familia mÃ¡s suave de tres, tiene la misiÃ³n de crear Whisky escocÃ©s de malta nuevo y de gran sabor.</p>', 'El singleton de Dufftown a menudo se describe como poseedor de una suavidad excepcional, aunque el espÃ­ritu de nueva creaciÃ³n de sus tres pares de imÃ¡genes tiene un carÃ¡cter picante. Usando una combinaciÃ³n de barricas de roble americano y europeo en aproximadamente una divisiÃ³n de 50/50.', 10, 135000, 1, 0, 'whisky-thesingleton-dufftown', 5, 0, 'Whisky The Singleton of Dufftown', 'whisky, singleton, dufftown, bogota, colombia, envios, domicilio, licor online', 'whisky, singleton, dufftown, singelton, singletown, duftown, dufton Coleccion_Maltas'),
