(448, 'Convier Triple Sec 25 (Blanco)', '750 ml', '<p style=\"text-align: justify;\">El convier Triple sec 25 es un licor elaborado a base del extracto natural proveniente de cascaras de naranja, a diferencia del <a title=\"Convier Triple Sec Blue\" href=\"https://www.lalicorera.com/productos/especiales/convier-triple-sec-blue\" target=\"_blank\">Convier Triple Sec</a>, como su nombre lo indica este contiene 25Â° de alcohol.</p>\r\n<p style=\"text-align: justify;\">Â Utilizado en cocteles como el Cosmopolitan, White Lady y Margarita.</p>', 'El convier Triple sec 25 es un licor elaborado a base del extracto natural proveniente de cascaras de naranja, a diferencia del Convier Triple Sec, como su nombre lo indica este contiene 25Â° de alcohol.', 4, 48200, 1, 2, 'convier-triple-sec-25', 1, 0, 'Convier Triple Sec 25 (Blanco)', 'Convier, Triple Sec, Blanco, 25, Domicilios, Bogota, Colombia, Licor online', 'Convier Combier Conbier Triple Sec Seco Blanco 25'),
(449, 'London Dry Gin No. 3', '750 ml', '<p class=\"MsoNormal\" style=\"text-align: justify;\">Ginebra London Dry Gin No. 3, un ginebra que no busca diferenciarse por medio de ingredientes distintos, al contrario, prefiere centrarse en la calidad de los clÃ¡sicos al utilizar: enebro, cilantro, cardamomo, piel de naranja, pomelo y raÃ­z de angÃ©lica y en la medida perfecta con el fin de obtener un perfecto Gin a la antigua usanza.</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">La llave estÃ¡ inspirada en aquella que abrÃ­a The Parlour, la mÃ¡s emblemÃ¡tica estancia del nÃºmero 3 de St. James Street en Londres, aquella que a lo largo de los Ãºltimos tres siglos albergÃ³ a notables dignatarios y personajes como Lord Byron, William Pitt o NapoleÃ³n III.</p>', 'Ginebra London Dry Gin No. 3, centrado en la calidad de los clÃ¡sicos al utilizar: enebro, cilantro, cardamomo, piel de naranja, pomelo y raÃ­z de angÃ©lica y en la medida perfecta con el fin de obtener un perfecto Gin a la antigua usanza.', 5, 186000, 1, 3, 'london-dry-gin-no-3', 3, 0, 'Ginebra London Dry Gin No. 3', 'London Dry Gin, No 3, Ginebra InglÃ©s, Domicilios, Bogota, Colombia, Licor online', 'Ginebra London Londres Dri Dry Gin Jinebra Jin Numero 3 No '),
